	VALUES (0, 'Jonathan_Joestar', 'Jonathan_Joestar@jojo.com', '$2b$12$a6bWUQaycXcJ2Eba.cKBUejIoGrQXWl4paTJVHG62UKIZkbG6dn92', 'Jonathan Joestar', 'Jonathan Joestar (ジョナサン・ジョースター, Jonasan Jōsutā) is the main protagonist of the first part of the JoJo''s Bizarre Adventure series, Phantom Blood, and the first JoJo of the series. His legacy extends throughout almost the entirety of the first six parts of the series, with major characters such as Joseph Joestar and Jotaro Kujo being his descendants.', TIMESTAMP WITH TIME ZONE '2019-09-01 23:00:02+00', 394.01::money, 'https://static.jojowiki.com/images/thumb/2/23/latest/20191212204955/JonathanAv.png/120px-JonathanAv.png', TRUE);
