	VALUES (2, 'Robert_E._O._Speedwagon', 'Robert_E._O._Speedwagon@jojo.com', '$2b$12$a6bWUQaycXcJ2Eba.cKBUejIoGrQXWl4paTJVHG62UKIZkbG6dn92', 'Robert E. O. Speedwagon', 'Robert E. O. Speedwagon (ロバート・E・O・スピードワゴン, Robāto Ī Ō Supīdowagon) is a primary ally featured in the 1st part of the JoJo''s Bizarre Adventure series, Phantom Blood. Formerly a Londoner thug residing in Ogre Street, Speedwagon befriends Jonathan Joestar and becomes a loyal ally to his cause.', TIMESTAMP WITH TIME ZONE '2018-07-05 01:26:53+00', 276.68::money, 'https://static.jojowiki.com/images/thumb/0/00/latest/20191212205000/SpeedwagonAv.png/120px-SpeedwagonAv.png', TRUE);
