	VALUES (55, 60, TIMESTAMP WITH TIME ZONE '2020-06-13 13:05:04+00', 'Foram sentidos vir-se da cidade.
');
	VALUES (55, 519, TIMESTAMP WITH TIME ZONE '2020-06-13 14:48:50+00', 'Do que lhe der a língua conselheira.
');

	VALUES (56, 234, TIMESTAMP WITH TIME ZONE '2019-07-21 21:28:21+00', 'Naquele cuja Lira sonorosa
');

	VALUES (57, 506, TIMESTAMP WITH TIME ZONE '2021-01-28 04:11:19+00', 'Que a tão altas empresas aspirava,
');
	VALUES (57, 63, TIMESTAMP WITH TIME ZONE '2021-01-28 09:48:06+00', 'Os mares nunca doutrem navegados,
');
	VALUES (57, 506, TIMESTAMP WITH TIME ZONE '2021-01-28 11:10:01+00', 'Em sangue Português, juram, descridos,
');

	VALUES (58, 64, TIMESTAMP WITH TIME ZONE '2020-10-03 13:36:58+00', 'Os feridos com grita o Céu feriam,
');
	VALUES (58, 64, TIMESTAMP WITH TIME ZONE '2020-10-03 15:17:58+00', 'Encomendado ao sacro Nicolau,
');

	VALUES (59, 301, TIMESTAMP WITH TIME ZONE '2020-11-14 18:37:31+00', 'Servimos; e, se mais o trato humano
');

	VALUES (60, 65, TIMESTAMP WITH TIME ZONE '2021-03-24 15:36:23+00', 'Na força está do corno temeroso:
');
	VALUES (60, 65, TIMESTAMP WITH TIME ZONE '2021-03-24 23:02:12+00', 'Já lá da banda do Austro e do Oriente,
');
	VALUES (60, 329, TIMESTAMP WITH TIME ZONE '2021-03-25 00:10:21+00', 'Este quis o Céu justo que floresça
');
	VALUES (60, 329, TIMESTAMP WITH TIME ZONE '2021-03-25 07:37:23+00', 'A alevantar com eles a fiança,
');

	VALUES (61, 66, TIMESTAMP WITH TIME ZONE '2021-01-30 22:15:33+00', 'Os fortes Lusitanos lhe tornavam
');
	VALUES (61, 66, TIMESTAMP WITH TIME ZONE '2021-01-31 00:49:56+00', 'O coração sublime, o régio peito,
');

	VALUES (62, 458, TIMESTAMP WITH TIME ZONE '2019-12-21 13:51:40+00', 'Algumas doces cítaras tocavam,
');
	VALUES (62, 458, TIMESTAMP WITH TIME ZONE '2019-12-21 13:59:48+00', 'Depois que a larga terra lhe aparece,
');
	VALUES (62, 458, TIMESTAMP WITH TIME ZONE '2019-12-21 15:00:14+00', 'Que, com lhe ouvir as últimas razões,
');

	VALUES (63, 426, TIMESTAMP WITH TIME ZONE '2018-08-13 13:58:25+00', 'Outros ásteas de setas delgaçando;
');
	VALUES (63, 68, TIMESTAMP WITH TIME ZONE '2018-08-13 14:53:09+00', 'Porque não é das forças Lusitanas,
');
	VALUES (63, 426, TIMESTAMP WITH TIME ZONE '2018-08-13 21:41:13+00', 'Das Indianas gentes belicosas.
');
	VALUES (63, 68, TIMESTAMP WITH TIME ZONE '2018-08-14 02:05:08+00', 'Nem por lisonja louve algum subido,
');

	VALUES (64, 565, TIMESTAMP WITH TIME ZONE '2018-09-20 22:28:47+00', 'Fareis os Reinos grandes e possantes,
');

	VALUES (65, 70, TIMESTAMP WITH TIME ZONE '2020-01-24 09:29:41+00', 'Para lá se inclinava a leda frota;
');
	VALUES (65, 256, TIMESTAMP WITH TIME ZONE '2020-01-24 10:00:05+00', 'Vestido o Gama vem ao modo Hispano,
');
	VALUES (65, 256, TIMESTAMP WITH TIME ZONE '2020-01-24 16:58:01+00', 'Pios Eneias, nem Aquiles feros.
');

	VALUES (66, 70, TIMESTAMP WITH TIME ZONE '2019-08-27 15:04:11+00', '"Não será assim, porque antes que chegado
');
	VALUES (66, 70, TIMESTAMP WITH TIME ZONE '2019-08-27 17:54:06+00', 'Tornar-se-lhe amarelo, de enfiado;
');
	VALUES (66, 70, TIMESTAMP WITH TIME ZONE '2019-08-27 23:38:46+00', 'Agora, com pobreza avorrecida,
');
	VALUES (66, 226, TIMESTAMP WITH TIME ZONE '2019-08-28 03:15:33+00', '"Alteradas então do Reino as gentes
');

	VALUES (67, 346, TIMESTAMP WITH TIME ZONE '2019-01-25 08:10:24+00', 'Sem sair nunca deste povo rudo,
');
	VALUES (67, 71, TIMESTAMP WITH TIME ZONE '2019-01-25 09:37:24+00', 'Que, quando ao medo infame não se rende,
');
	VALUES (67, 346, TIMESTAMP WITH TIME ZONE '2019-01-25 09:53:52+00', 'De fazer de Lisboa nova Roma;
');

	VALUES (68, 298, TIMESTAMP WITH TIME ZONE '2018-12-24 05:28:36+00', 'Uns caem meios mortos, e outros vão
');
	VALUES (68, 298, TIMESTAMP WITH TIME ZONE '2018-12-24 09:00:55+00', 'O valeroso ofício de Minerva;
');
	VALUES (68, 298, TIMESTAMP WITH TIME ZONE '2018-12-24 15:34:38+00', 'As mulheres c''um choro piedoso,
');
	VALUES (68, 298, TIMESTAMP WITH TIME ZONE '2018-12-24 19:35:33+00', 'Para onde o mar na costa brada e geme,
');

	VALUES (69, 72, TIMESTAMP WITH TIME ZONE '2021-02-11 17:21:22+00', 'Açoute de soberbos Castelhanos
');

	VALUES (70, 220, TIMESTAMP WITH TIME ZONE '2019-10-23 22:48:47+00', 'Aonde as naus estavam temerosas,
');
	VALUES (70, 220, TIMESTAMP WITH TIME ZONE '2019-10-24 04:57:12+00', 'Subindo, ergueu das Quinis a bandeira.
');
	VALUES (70, 72, TIMESTAMP WITH TIME ZONE '2019-10-24 07:39:50+00', 'Foi como este na guerra forte e sábio."
');
	VALUES (70, 220, TIMESTAMP WITH TIME ZONE '2019-10-24 14:32:39+00', 'Um na cabeça cornos esculpidos,
');

	VALUES (71, 136, TIMESTAMP WITH TIME ZONE '2020-07-09 14:55:31+00', 'Eu tenho imaginado no conceito
');
	VALUES (71, 74, TIMESTAMP WITH TIME ZONE '2020-07-09 20:59:47+00', 'Três marinheiros, duros e forçosos,
');

	VALUES (72, 592, TIMESTAMP WITH TIME ZONE '2018-07-11 09:22:27+00', 'Perdendo o esforço veio, e bélica arte;
');

	VALUES (73, 582, TIMESTAMP WITH TIME ZONE '2019-07-26 00:16:58+00', 'Dessas aves de Júpiter validas;
');

	VALUES (74, 441, TIMESTAMP WITH TIME ZONE '2020-06-20 06:21:00+00', 'É ele pera dar-te um Reino rico.
');

	VALUES (75, 563, TIMESTAMP WITH TIME ZONE '2020-12-27 12:55:03+00', 'Mercadoria, que ofereça rica,
');
	VALUES (75, 563, TIMESTAMP WITH TIME ZONE '2020-12-27 17:14:39+00', 'A desesperarão, e frio medo
');
	VALUES (75, 563, TIMESTAMP WITH TIME ZONE '2020-12-27 22:49:11+00', '"Mas ele enfim, com causa desonrado,
');
	VALUES (75, 80, TIMESTAMP WITH TIME ZONE '2020-12-28 00:16:56+00', 'Mova-vos já sequer riqueza tanta,
');

	VALUES (76, 628, TIMESTAMP WITH TIME ZONE '2020-10-30 17:47:09+00', 'Ou foi já assinalado de seu ferro:
');

	VALUES (77, 431, TIMESTAMP WITH TIME ZONE '2019-07-12 12:17:29+00', 'Com três rostos, debaxo vai Diana.
');
	VALUES (77, 81, TIMESTAMP WITH TIME ZONE '2019-07-12 19:47:36+00', 'Mais célebre por nome que por fama:
');
	VALUES (77, 81, TIMESTAMP WITH TIME ZONE '2019-07-13 03:39:40+00', 'Para acharem a terra que buscavam;
');
	VALUES (77, 81, TIMESTAMP WITH TIME ZONE '2019-07-13 04:37:09+00', 'Em vós os olhos tem o Mouro frio,
');

	VALUES (78, 88, TIMESTAMP WITH TIME ZONE '2020-10-20 03:41:57+00', 'Com ele posta em campo já se via;
');

	VALUES (79, 85, TIMESTAMP WITH TIME ZONE '2021-01-29 06:16:09+00', 'Doenças, frechas e trovões ardentes,
');

	VALUES (80, 511, TIMESTAMP WITH TIME ZONE '2021-01-09 22:46:58+00', 'E outra terra acharás de mais verdade,
');
	VALUES (80, 511, TIMESTAMP WITH TIME ZONE '2021-01-09 23:49:11+00', 'Dos inimigos a terra lhe corria,
');
	VALUES (80, 85, TIMESTAMP WITH TIME ZONE '2021-01-10 03:19:36+00', 'Dos fados as entranhas revolvendo,
');
	VALUES (80, 511, TIMESTAMP WITH TIME ZONE '2021-01-10 06:07:25+00', 'Estranhos, assim mesmo como aos nossos,
');

	VALUES (81, 87, TIMESTAMP WITH TIME ZONE '2021-02-17 11:32:08+00', 'Com quem sua incontinência desonesta
');
	VALUES (81, 117, TIMESTAMP WITH TIME ZONE '2021-02-17 12:47:03+00', 'Naires chamados são, e a menos digna
');
	VALUES (81, 87, TIMESTAMP WITH TIME ZONE '2021-02-17 14:57:50+00', 'Em virtude do Rei, da pátria mesta,
');
	VALUES (81, 87, TIMESTAMP WITH TIME ZONE '2021-02-17 16:13:02+00', 'Com os olhos, que de tudo são senhores,
');

	VALUES (82, 482, TIMESTAMP WITH TIME ZONE '2020-11-11 22:11:21+00', 'O rosto carregado, a barba esquálida,
');

	VALUES (83, 89, TIMESTAMP WITH TIME ZONE '2021-03-12 16:06:45+00', 'De outra pedra mais clara que diamante.
');
	VALUES (83, 89, TIMESTAMP WITH TIME ZONE '2021-03-12 20:57:46+00', 'De sua estranha vinda, se queria,
');

	VALUES (84, 90, TIMESTAMP WITH TIME ZONE '2021-04-29 16:58:56+00', 'Não eram os traquetes bem tomados,
');
	VALUES (84, 90, TIMESTAMP WITH TIME ZONE '2021-04-29 23:55:23+00', 'Porque as lágrimas já correndo a pares
');
	VALUES (84, 90, TIMESTAMP WITH TIME ZONE '2021-04-30 02:25:57+00', 'Na alagoa Meotis, curvo o frio,
');

	VALUES (85, 546, TIMESTAMP WITH TIME ZONE '2021-04-10 19:26:48+00', 'Que pelejando está co''o Mauritano.
');
	VALUES (85, 90, TIMESTAMP WITH TIME ZONE '2021-04-10 19:32:59+00', 'Para o avô cruel assim dizia:
');

	VALUES (86, 91, TIMESTAMP WITH TIME ZONE '2020-06-21 16:28:32+00', 'Para ajudar na guerra a seus senhores.
');

	VALUES (87, 92, TIMESTAMP WITH TIME ZONE '2020-09-23 00:57:22+00', 'Domésticos já tanto e companheiros
');
	VALUES (87, 92, TIMESTAMP WITH TIME ZONE '2020-09-23 03:00:53+00', 'Ouvindo clara a língua de Castela;
');
	VALUES (87, 92, TIMESTAMP WITH TIME ZONE '2020-09-23 04:06:32+00', 'Sustentava contra ele Vénus bela,
');

	VALUES (88, 479, TIMESTAMP WITH TIME ZONE '2020-11-13 17:24:00+00', 'Instrumentos de guerra tudo atroam.
');
	VALUES (88, 479, TIMESTAMP WITH TIME ZONE '2020-11-13 19:27:53+00', 'E lá bem junto donde nasce o dia,
');
	VALUES (88, 479, TIMESTAMP WITH TIME ZONE '2020-11-13 20:22:00+00', 'Curam-no às vezes ásperas triagas.
');
	VALUES (88, 479, TIMESTAMP WITH TIME ZONE '2020-11-14 04:11:32+00', 'Por nós já convertido à fé de Cristo,
');

	VALUES (89, 416, TIMESTAMP WITH TIME ZONE '2020-12-13 11:16:56+00', 'Três formosos outeiros se mostravam
');
	VALUES (89, 416, TIMESTAMP WITH TIME ZONE '2020-12-13 12:36:06+00', 'E, porque o caso leve se lhe faça,
');
	VALUES (89, 416, TIMESTAMP WITH TIME ZONE '2020-12-13 19:56:32+00', 'E outras várias nações, que o Reno frio
');

	VALUES (90, 96, TIMESTAMP WITH TIME ZONE '2020-12-27 15:18:31+00', 'Demos lugar ao nome Lusitano?
');
	VALUES (90, 223, TIMESTAMP WITH TIME ZONE '2020-12-27 18:39:16+00', 'Vimos a parte menos rutilante,
');
	VALUES (90, 223, TIMESTAMP WITH TIME ZONE '2020-12-27 21:06:03+00', 'Que também com suas armas se moveu,
');

	VALUES (91, 100, TIMESTAMP WITH TIME ZONE '2021-01-12 07:45:47+00', 'Mas o mau de Tioneu, que na alma sente
');
	VALUES (91, 685, TIMESTAMP WITH TIME ZONE '2021-01-12 15:14:42+00', 'Manda mais um, na prática elegante,
');
	VALUES (91, 100, TIMESTAMP WITH TIME ZONE '2021-01-12 17:01:23+00', 'Nem por lisonja louve algum subido,
');

	VALUES (92, 622, TIMESTAMP WITH TIME ZONE '2019-09-28 16:28:48+00', 'Desejoso de ver as coisas grandes,
');
	VALUES (92, 101, TIMESTAMP WITH TIME ZONE '2019-09-28 21:29:05+00', 'De todo o Oriente conhecido,
');
	VALUES (92, 622, TIMESTAMP WITH TIME ZONE '2019-09-28 22:13:30+00', 'Lá pera o grande lago que rodeia
');

	VALUES (93, 104, TIMESTAMP WITH TIME ZONE '2019-12-22 02:13:16+00', 'Quando do ferro as vidas escapavam.
');
	VALUES (93, 104, TIMESTAMP WITH TIME ZONE '2019-12-22 04:27:28+00', 'E quando desce o deixa derradeiro;
');
	VALUES (93, 104, TIMESTAMP WITH TIME ZONE '2019-12-22 06:10:00+00', 'Os Brâmenes se encheram de ódio tanto,
');
	VALUES (93, 660, TIMESTAMP WITH TIME ZONE '2019-12-22 11:49:30+00', 'Tenha firme, segura, limpa e branda;
');

	VALUES (94, 104, TIMESTAMP WITH TIME ZONE '2019-07-20 03:38:45+00', 'Sem vós, Ninfas do Tejo e do Mondego,
');

	VALUES (95, 365, TIMESTAMP WITH TIME ZONE '2020-06-27 00:05:09+00', 'Com a mãe Agripina cometia;
');

	VALUES (96, 462, TIMESTAMP WITH TIME ZONE '2020-12-27 19:14:45+00', 'Do Capitão e gente se apartou
');

	VALUES (97, 108, TIMESTAMP WITH TIME ZONE '2021-03-16 19:39:53+00', 'Provariam do braço duro e forte,
');
	VALUES (97, 322, TIMESTAMP WITH TIME ZONE '2021-03-16 20:19:23+00', 'Que por se sustentar em toda idade,
');
	VALUES (97, 108, TIMESTAMP WITH TIME ZONE '2021-03-16 21:11:54+00', 'E além disso nenhum contentamento,
');
	VALUES (97, 108, TIMESTAMP WITH TIME ZONE '2021-03-16 21:56:00+00', 'Da religiosa água Maumetana.
');

	VALUES (98, 289, TIMESTAMP WITH TIME ZONE '2019-04-18 05:10:10+00', 'Principalmente aqui, que sou chegado
');
	VALUES (98, 289, TIMESTAMP WITH TIME ZONE '2019-04-18 08:55:29+00', '"Um Sacerdote vê brandindo a espada
');
	VALUES (98, 289, TIMESTAMP WITH TIME ZONE '2019-04-18 16:54:37+00', 'Usar mais largamente de seus vícios;
');

	VALUES (99, 413, TIMESTAMP WITH TIME ZONE '2021-01-14 22:33:06+00', 'De vigiar a noite que arreceia,
');
	VALUES (99, 413, TIMESTAMP WITH TIME ZONE '2021-01-15 04:25:16+00', 'Destes arrenegados muitos são
');

	VALUES (100, 112, TIMESTAMP WITH TIME ZONE '2020-05-04 12:02:43+00', '"Não disse mais o rio ilustre e santo,
');
	VALUES (100, 272, TIMESTAMP WITH TIME ZONE '2020-05-04 13:12:39+00', 'Com ela ficam Álvaro e Diogo,
');
	VALUES (100, 272, TIMESTAMP WITH TIME ZONE '2020-05-04 16:14:52+00', 'Que um ergue Dio, outro o defende erguido.
');
	VALUES (100, 272, TIMESTAMP WITH TIME ZONE '2020-05-04 22:37:42+00', 'Sem irdes a pregar a santa Fé?
');

	VALUES (101, 313, TIMESTAMP WITH TIME ZONE '2021-03-20 02:15:21+00', 'Imitando seu pai na valentia,
');
	VALUES (101, 313, TIMESTAMP WITH TIME ZONE '2021-03-20 08:55:13+00', 'Despois, lançando arpéus ousadamente
');
	VALUES (101, 313, TIMESTAMP WITH TIME ZONE '2021-03-20 14:00:08+00', 'Com lágrimas de dor, de mágoa pura,
');

	VALUES (102, 461, TIMESTAMP WITH TIME ZONE '2019-09-23 11:38:35+00', 'Por cima dos arneses: bravo estrago!
');

	VALUES (103, 115, TIMESTAMP WITH TIME ZONE '2020-06-30 10:19:57+00', 'Que a cidade queimasse onde vivia,
');

	VALUES (104, 117, TIMESTAMP WITH TIME ZONE '2020-01-07 13:38:10+00', 'Andava sempre a gente assinalada,
');
	VALUES (104, 117, TIMESTAMP WITH TIME ZONE '2020-01-07 16:46:56+00', 'A terra e o largo mar, com leda fronte.
');

	VALUES (105, 585, TIMESTAMP WITH TIME ZONE '2020-01-12 16:51:26+00', 'Com sonoroso aplauso, vozes davam,
');

	VALUES (106, 119, TIMESTAMP WITH TIME ZONE '2020-07-18 14:24:21+00', 'Entra, pelo fortíssimo edifício,
');
	VALUES (106, 511, TIMESTAMP WITH TIME ZONE '2020-07-18 15:25:47+00', 'Que mais que a própria morte a magoava,
');
	VALUES (106, 511, TIMESTAMP WITH TIME ZONE '2020-07-18 22:29:33+00', 'E o princípio do Reino tão potente,
');
	VALUES (106, 511, TIMESTAMP WITH TIME ZONE '2020-07-19 06:19:29+00', '"Corrupto já e danado o mantimento,
');

	VALUES (107, 613, TIMESTAMP WITH TIME ZONE '2020-08-11 15:17:40+00', 'O povo que concorre vai confuso
');
	VALUES (107, 120, TIMESTAMP WITH TIME ZONE '2020-08-11 15:52:06+00', 'Quanto pode de Atenas desejar-se,
');
	VALUES (107, 613, TIMESTAMP WITH TIME ZONE '2020-08-11 22:00:43+00', 'C''um saber só de experiências feito,
');
	VALUES (107, 120, TIMESTAMP WITH TIME ZONE '2020-08-12 01:04:41+00', 'Tanto Deus se contenta de humildade!
');

	VALUES (108, 121, TIMESTAMP WITH TIME ZONE '2021-03-11 05:04:57+00', 'Que o coração converte, que tem preso,
');
	VALUES (108, 121, TIMESTAMP WITH TIME ZONE '2021-03-11 07:02:42+00', 'Este famoso Rei, todos os dias,
');

	VALUES (109, 457, TIMESTAMP WITH TIME ZONE '2020-05-16 15:56:53+00', 'Terá a Malaca muito tempo feitos,
');
	VALUES (109, 457, TIMESTAMP WITH TIME ZONE '2020-05-16 21:51:29+00', 'Estará de contino aparelhado
');
	VALUES (109, 122, TIMESTAMP WITH TIME ZONE '2020-05-17 03:17:21+00', 'Isto dizendo, manda os diligentes
');

	VALUES (110, 565, TIMESTAMP WITH TIME ZONE '2019-01-17 22:56:13+00', '"Eis aqui, quase cume da cabeça
');
	VALUES (110, 565, TIMESTAMP WITH TIME ZONE '2019-01-18 02:31:16+00', '"Ali chegado, ou fosse caso ou manha,
');
	VALUES (110, 565, TIMESTAMP WITH TIME ZONE '2019-01-18 04:25:06+00', 'Levassem prémio digno e dons iguais.
');
	VALUES (110, 125, TIMESTAMP WITH TIME ZONE '2019-01-18 09:15:35+00', 'Contra o tão raro em gente Lusitano,
');

	VALUES (111, 129, TIMESTAMP WITH TIME ZONE '2019-04-27 11:28:37+00', '--"Portugal! Portugal!" alçando a mão
');
	VALUES (111, 289, TIMESTAMP WITH TIME ZONE '2019-04-27 12:03:12+00', 'Tudo aquilo obedece, que criaste,
');
	VALUES (111, 289, TIMESTAMP WITH TIME ZONE '2019-04-27 14:01:58+00', 'Parte também, co pau vermelho nota;
');
	VALUES (111, 129, TIMESTAMP WITH TIME ZONE '2019-04-27 16:45:15+00', 'Co Cabo que até''aqui se vos negara,
');

	VALUES (112, 130, TIMESTAMP WITH TIME ZONE '2019-09-06 03:56:56+00', 'Consigo estas palavras praticava:
');
	VALUES (112, 130, TIMESTAMP WITH TIME ZONE '2019-09-06 09:59:04+00', 'Que as damas vencedoras se conheçam,
');

	VALUES (113, 626, TIMESTAMP WITH TIME ZONE '2019-10-28 16:45:59+00', 'Quando o tempo futuro especularam.
');
	VALUES (113, 130, TIMESTAMP WITH TIME ZONE '2019-10-28 17:30:04+00', 'Esculpido o feroz ginete ardente,
');
	VALUES (113, 130, TIMESTAMP WITH TIME ZONE '2019-10-29 00:26:41+00', 'E dos rios as águas saudosas
');
	VALUES (113, 130, TIMESTAMP WITH TIME ZONE '2019-10-29 02:35:37+00', 'Os feridos com grita o Céu feriam,
');

	VALUES (114, 134, TIMESTAMP WITH TIME ZONE '2021-03-20 00:39:37+00', 'Do nome da irmã sua assim chamada,
');
	VALUES (114, 319, TIMESTAMP WITH TIME ZONE '2021-03-20 04:45:56+00', 'Até que, nas maiores opressões,
');
	VALUES (114, 319, TIMESTAMP WITH TIME ZONE '2021-03-20 06:39:27+00', 'De Baco nos teus reinos receberes,
');
	VALUES (114, 134, TIMESTAMP WITH TIME ZONE '2021-03-20 12:34:42+00', 'Sem passar se deteve muitos dias:
');

	VALUES (115, 385, TIMESTAMP WITH TIME ZONE '2021-04-12 21:05:35+00', '"Nem tu menos fugir poderás deste,
');
	VALUES (115, 135, TIMESTAMP WITH TIME ZONE '2021-04-13 02:24:40+00', 'Que, só pera abalar-se, nada abasta;
');

	VALUES (116, 137, TIMESTAMP WITH TIME ZONE '2021-03-02 12:27:23+00', 'De novo são, serão muito grande dano
');

	VALUES (117, 478, TIMESTAMP WITH TIME ZONE '2021-03-21 10:01:23+00', 'E vendo claro quanto lhe releva
');

	VALUES (118, 144, TIMESTAMP WITH TIME ZONE '2021-03-30 17:23:52+00', 'Por tais costas e mares com ele ande,
');
	VALUES (118, 144, TIMESTAMP WITH TIME ZONE '2021-03-30 20:35:19+00', 'Por te trazer ao fim, e extremo dano;
');

	VALUES (119, 604, TIMESTAMP WITH TIME ZONE '2020-12-30 13:01:14+00', 'Armas, cavalo, ao bélico serviço.
');

	VALUES (120, 575, TIMESTAMP WITH TIME ZONE '2021-04-16 07:08:47+00', 'Piloto, munições e mantimentos."
');
	VALUES (120, 139, TIMESTAMP WITH TIME ZONE '2021-04-16 13:35:04+00', 'A gente nos batéis se concertava,
');
	VALUES (120, 575, TIMESTAMP WITH TIME ZONE '2021-04-16 16:32:49+00', 'Aquelas proeminências gloriosas,
');
	VALUES (120, 575, TIMESTAMP WITH TIME ZONE '2021-04-16 20:23:06+00', 'A lhe dar tanta ajuda, em quanto posso,
');

	VALUES (121, 140, TIMESTAMP WITH TIME ZONE '2020-08-21 00:20:01+00', 'O invisível Ar, que mais asinha
');

	VALUES (122, 199, TIMESTAMP WITH TIME ZONE '2020-05-02 15:14:54+00', 'Lhe manda mais, que em sonhos lhe mostra
');

	VALUES (123, 144, TIMESTAMP WITH TIME ZONE '2020-10-09 04:22:32+00', '"Não nego que há contudo descendentes
');
	VALUES (123, 144, TIMESTAMP WITH TIME ZONE '2020-10-09 10:12:30+00', 'A vender a pedraria que trouxeram.
');
	VALUES (123, 144, TIMESTAMP WITH TIME ZONE '2020-10-09 17:11:09+00', 'Tomai conselho só d''exprimentados
');

