	VALUES (328, 583, TIMESTAMP WITH TIME ZONE '2020-04-09 04:10:31+00', 'Alevanta-se nisto o movimento
');

	VALUES (329, 524, TIMESTAMP WITH TIME ZONE '2018-09-17 04:54:45+00', 'Suaves vêm a um tempo conformando.
');
	VALUES (329, 524, TIMESTAMP WITH TIME ZONE '2018-09-17 09:26:34+00', 'Para lá logo as proas se inclinaram,
');
	VALUES (329, 328, TIMESTAMP WITH TIME ZONE '2018-09-17 09:32:21+00', 'Gentes que tais caminhos cometessem?
');
	VALUES (329, 328, TIMESTAMP WITH TIME ZONE '2018-09-17 14:15:05+00', 'Queimava então os Deuses, que Tifeu
');

	VALUES (330, 330, TIMESTAMP WITH TIME ZONE '2021-05-04 15:50:45+00', 'Só por ouvir o amante da donzela
');
	VALUES (330, 403, TIMESTAMP WITH TIME ZONE '2021-05-04 20:48:22+00', 'O desprezo da vida, que devia
');
	VALUES (330, 403, TIMESTAMP WITH TIME ZONE '2021-05-05 03:14:10+00', 'Um de escudo embraçado e de azagaia,
');
	VALUES (330, 403, TIMESTAMP WITH TIME ZONE '2021-05-05 08:53:17+00', 'Que por seguir um feio animal fero,
');

	VALUES (331, 331, TIMESTAMP WITH TIME ZONE '2020-03-04 23:28:40+00', 'Neste remoto cabo converteram
');
	VALUES (331, 331, TIMESTAMP WITH TIME ZONE '2020-03-05 02:20:40+00', 'Deixando a frota, em nenhum porto ou praia.
');

	VALUES (332, 537, TIMESTAMP WITH TIME ZONE '2020-01-13 13:28:06+00', 'Isto Mercúrio disse, e o sono leva
');
	VALUES (332, 331, TIMESTAMP WITH TIME ZONE '2020-01-13 18:39:40+00', '--"Não tens junto contigo o Ismaelita,
');
	VALUES (332, 537, TIMESTAMP WITH TIME ZONE '2020-01-13 21:35:34+00', 'Curva e quieta, cuja branca areia,
');

	VALUES (333, 332, TIMESTAMP WITH TIME ZONE '2019-11-02 19:41:51+00', 'Outra manha e ardil, que te contente:
');
	VALUES (333, 535, TIMESTAMP WITH TIME ZONE '2019-11-03 03:22:28+00', 'Onde súbito se acha vencedora.
');
	VALUES (333, 332, TIMESTAMP WITH TIME ZONE '2019-11-03 10:40:25+00', 'Com que nos poucos seus o esforço cresce.
');
	VALUES (333, 535, TIMESTAMP WITH TIME ZONE '2019-11-03 17:31:18+00', 'Vários costumes seus e várias leis.
');

	VALUES (334, 333, TIMESTAMP WITH TIME ZONE '2021-03-05 15:52:43+00', 'Quem para reger era os mui possantes
');
	VALUES (334, 667, TIMESTAMP WITH TIME ZONE '2021-03-05 16:56:31+00', 'Os que foram roubar a bela Helena,
');

	VALUES (335, 504, TIMESTAMP WITH TIME ZONE '2020-07-09 00:38:07+00', 'Que, depois de lhe ter dito quem era,
');
	VALUES (335, 504, TIMESTAMP WITH TIME ZONE '2020-07-09 03:37:36+00', 'Mostrando-se no mar um fero raio,
');

	VALUES (336, 628, TIMESTAMP WITH TIME ZONE '2020-11-20 22:58:26+00', 'Todo o coro das Ninfas, e obedece,
');

	VALUES (337, 373, TIMESTAMP WITH TIME ZONE '2020-02-19 14:19:26+00', 'Que não há nenhum deles que não saia
');
	VALUES (337, 335, TIMESTAMP WITH TIME ZONE '2020-02-19 15:09:42+00', '"Porque tantas batalhas, sustentadas
');
	VALUES (337, 373, TIMESTAMP WITH TIME ZONE '2020-02-19 20:17:26+00', 'Aparelhamos a alma para a morte,
');
	VALUES (337, 373, TIMESTAMP WITH TIME ZONE '2020-02-19 21:28:15+00', 'Do Perineu, que Espanha e Gália parte;
');

	VALUES (338, 336, TIMESTAMP WITH TIME ZONE '2019-10-27 05:10:25+00', 'Onde a gente belígera se estende.
');
	VALUES (338, 336, TIMESTAMP WITH TIME ZONE '2019-10-27 12:28:10+00', 'O piloto fugir-lhe com presteza,
');
	VALUES (338, 640, TIMESTAMP WITH TIME ZONE '2019-10-27 17:21:43+00', 'Os Deuses, e por mais dobradas mágoas,
');
	VALUES (338, 336, TIMESTAMP WITH TIME ZONE '2019-10-27 17:52:26+00', 'Vês? já a vila de Alcáçare se humilha,
');

	VALUES (339, 394, TIMESTAMP WITH TIME ZONE '2019-08-20 02:23:40+00', 'A seus batéis com toda a companhia;
');
	VALUES (339, 394, TIMESTAMP WITH TIME ZONE '2019-08-20 09:58:05+00', 'Trombeta de seu pai, e seu correio.
');
	VALUES (339, 394, TIMESTAMP WITH TIME ZONE '2019-08-20 11:00:55+00', 'De Argos, da Hidra a luz, da Lebre e da Ara.
');
	VALUES (339, 394, TIMESTAMP WITH TIME ZONE '2019-08-20 15:30:03+00', 'Onde segunda vez terra tomamos.
');

	VALUES (340, 351, TIMESTAMP WITH TIME ZONE '2020-03-09 06:00:04+00', 'Nem menos adultério desonesto,
');
	VALUES (340, 351, TIMESTAMP WITH TIME ZONE '2020-03-09 06:03:42+00', 'Ou como banhar possa o ferro bruto
');
	VALUES (340, 339, TIMESTAMP WITH TIME ZONE '2020-03-09 06:39:07+00', 'Uma cidade nela situada,
');

	VALUES (341, 339, TIMESTAMP WITH TIME ZONE '2021-01-30 18:40:05+00', 'Não há também Virgílios nem Homeros;
');
	VALUES (341, 410, TIMESTAMP WITH TIME ZONE '2021-01-31 00:02:13+00', 'Idade d''ouro, tanto te privou,
');

	VALUES (342, 514, TIMESTAMP WITH TIME ZONE '2020-10-19 01:37:15+00', 'Que aos grandes não dêem o dos pequenos;
');
	VALUES (342, 514, TIMESTAMP WITH TIME ZONE '2020-10-19 05:50:41+00', 'O velho Afonso, Príncipe subido,
');
	VALUES (342, 342, TIMESTAMP WITH TIME ZONE '2020-10-19 07:24:07+00', 'O crédito me pedes do que digo,
');

	VALUES (343, 459, TIMESTAMP WITH TIME ZONE '2020-10-03 00:46:18+00', '--"Mas ó tu, geração daquele insano,
');
	VALUES (343, 343, TIMESTAMP WITH TIME ZONE '2020-10-03 05:01:51+00', 'Mas comer o Gentio não pretende,
');
	VALUES (343, 343, TIMESTAMP WITH TIME ZONE '2020-10-03 05:28:34+00', 'Diante do pai ledo, que a agasalha,
');
	VALUES (343, 459, TIMESTAMP WITH TIME ZONE '2020-10-03 10:53:35+00', 'Por estes vos darei um Nuno fero,
');

	VALUES (344, 345, TIMESTAMP WITH TIME ZONE '2018-07-14 03:52:08+00', 'Dous inimigos vencem: uns, os vivos,
');

	VALUES (345, 346, TIMESTAMP WITH TIME ZONE '2019-12-29 09:27:12+00', 'E para que mais certas se conheçam
');
	VALUES (345, 492, TIMESTAMP WITH TIME ZONE '2019-12-29 13:54:13+00', 'Razões, à morte crua o persuade.
');
	VALUES (345, 492, TIMESTAMP WITH TIME ZONE '2019-12-29 15:51:08+00', 'Que sobre ela, empecendo, também caia
');

	VALUES (346, 346, TIMESTAMP WITH TIME ZONE '2020-04-12 06:48:57+00', 'Para espertar engenhos curiosos,
');
	VALUES (346, 419, TIMESTAMP WITH TIME ZONE '2020-04-12 14:37:23+00', 'Atenas, Ios, Argo e Salamina:
');
	VALUES (346, 346, TIMESTAMP WITH TIME ZONE '2020-04-12 18:30:46+00', 'Muito mal dos estranhos compadece.
');

	VALUES (347, 349, TIMESTAMP WITH TIME ZONE '2018-08-10 23:20:25+00', 'Arruinar a máquina do mundo:
');
	VALUES (347, 610, TIMESTAMP WITH TIME ZONE '2018-08-10 23:36:11+00', 'Depois que o Rei Fernando faleceu.
');
	VALUES (347, 349, TIMESTAMP WITH TIME ZONE '2018-08-11 02:55:04+00', 'Ser com amores mal afortunado,
');
	VALUES (347, 349, TIMESTAMP WITH TIME ZONE '2018-08-11 07:26:53+00', '"Em torno o cerca o Reino Neptunino,
');

	VALUES (348, 350, TIMESTAMP WITH TIME ZONE '2020-10-16 10:37:05+00', 'Mas o Rei, vendo a estranha lealdade,
');
	VALUES (348, 350, TIMESTAMP WITH TIME ZONE '2020-10-16 15:27:34+00', 'Então não era ilustre nem prezado;
');
	VALUES (348, 350, TIMESTAMP WITH TIME ZONE '2020-10-16 22:35:57+00', 'Que tanto em seus descuidos se desmede,
');

	VALUES (349, 353, TIMESTAMP WITH TIME ZONE '2021-02-07 00:48:51+00', 'O mar todo com fogo e ferro ferve,
');
	VALUES (349, 566, TIMESTAMP WITH TIME ZONE '2021-02-07 00:59:09+00', 'Mas da soberba Europa navegando,
');
	VALUES (349, 566, TIMESTAMP WITH TIME ZONE '2021-02-07 06:28:42+00', 'Que os céus, o mar e terra senhoreias;
');

	VALUES (350, 354, TIMESTAMP WITH TIME ZONE '2020-12-21 09:17:26+00', 'C''um resplendor reluze adamantino;
');

	VALUES (351, 487, TIMESTAMP WITH TIME ZONE '2020-12-09 03:26:48+00', '"Mas Afonso, do Reino único herdeiro,
');
	VALUES (351, 487, TIMESTAMP WITH TIME ZONE '2020-12-09 08:19:15+00', 'A boca negra, os dentes amarelos.
');
	VALUES (351, 487, TIMESTAMP WITH TIME ZONE '2020-12-09 14:10:14+00', 'A vergonha da Deusa caçadora,
');
	VALUES (351, 487, TIMESTAMP WITH TIME ZONE '2020-12-09 16:14:54+00', 'Que eu tanto tempo há já que guardo e tenho,
');

	VALUES (352, 356, TIMESTAMP WITH TIME ZONE '2020-05-01 15:09:41+00', 'Mas ela, com um formoso riso honesto,
');
	VALUES (352, 363, TIMESTAMP WITH TIME ZONE '2020-05-01 15:46:59+00', 'Falando está, que a triste Vénus, quando
');
	VALUES (352, 356, TIMESTAMP WITH TIME ZONE '2020-05-01 18:47:17+00', 'Remete à que não era irmã de Febo.
');

	VALUES (353, 554, TIMESTAMP WITH TIME ZONE '2021-03-23 07:55:42+00', 'Também aos maus se dá, mas falsamente.
');

	VALUES (354, 362, TIMESTAMP WITH TIME ZONE '2020-05-29 00:54:05+00', 'Mas, não querendo a Deusa guardadora,
');
	VALUES (354, 693, TIMESTAMP WITH TIME ZONE '2020-05-29 03:38:13+00', 'Vendo como diante ameaçando
');
	VALUES (354, 362, TIMESTAMP WITH TIME ZONE '2020-05-29 06:02:42+00', '"A nobre ilha também de Taprobana,
');

	VALUES (355, 362, TIMESTAMP WITH TIME ZONE '2020-02-02 03:10:02+00', 'Senhor só de vassalos excelentes.
');

	VALUES (356, 363, TIMESTAMP WITH TIME ZONE '2020-08-10 21:44:40+00', 'Nem o Peno asperíssimo contrário
');
	VALUES (356, 515, TIMESTAMP WITH TIME ZONE '2020-08-11 05:23:21+00', 'Fazer uma famosa expedição
');

	VALUES (357, 363, TIMESTAMP WITH TIME ZONE '2020-05-27 20:02:20+00', '(Quais, no profundo Reino, os nus espritos
');
	VALUES (357, 363, TIMESTAMP WITH TIME ZONE '2020-05-28 03:22:50+00', 'Já se sentem no Céu, por toda a parte,
');
	VALUES (357, 363, TIMESTAMP WITH TIME ZONE '2020-05-28 11:01:19+00', 'De quem tanto os Troianos se ajudaram,
');

	VALUES (358, 411, TIMESTAMP WITH TIME ZONE '2020-05-29 22:38:59+00', 'Onde Antenor já muros levantou,
');
	VALUES (358, 411, TIMESTAMP WITH TIME ZONE '2020-05-29 23:58:31+00', 'A terra e o largo mar, com leda fronte.
');

	VALUES (359, 364, TIMESTAMP WITH TIME ZONE '2021-02-18 00:30:14+00', 'Em lugar das guerreiras azagaias
');
	VALUES (359, 407, TIMESTAMP WITH TIME ZONE '2021-02-18 05:11:43+00', 'Partido desigual e dissonante
');
	VALUES (359, 364, TIMESTAMP WITH TIME ZONE '2021-02-18 06:20:00+00', '"Desta arte o Mouro atónito e torvado,
');
	VALUES (359, 364, TIMESTAMP WITH TIME ZONE '2021-02-18 12:36:40+00', 'Provariam do braço duro e forte,
');

	VALUES (360, 365, TIMESTAMP WITH TIME ZONE '2020-08-07 14:33:16+00', 'Que dizem ser de Celo e Vesta filha,
');
	VALUES (360, 365, TIMESTAMP WITH TIME ZONE '2020-08-07 19:02:18+00', 'Não sabem a razão de fúria tanta,
');
	VALUES (360, 645, TIMESTAMP WITH TIME ZONE '2020-08-08 01:58:26+00', 'Cuidou que entre estes Mouros o tomasse;
');

	VALUES (361, 365, TIMESTAMP WITH TIME ZONE '2018-09-18 21:12:37+00', 'Ó que famintos beijos na floresta,
');
	VALUES (361, 597, TIMESTAMP WITH TIME ZONE '2018-09-19 02:07:06+00', 'Que, só com refrear o passo leve,
');

	VALUES (362, 366, TIMESTAMP WITH TIME ZONE '2019-06-15 18:10:09+00', 'Qual a Quimera em membros se varia:
');
	VALUES (362, 629, TIMESTAMP WITH TIME ZONE '2019-06-16 00:01:12+00', 'E fareis claro o Rei, que tanto amais,
');

	VALUES (363, 366, TIMESTAMP WITH TIME ZONE '2020-09-03 08:34:22+00', 'Sendo dina de infames vitupérios;
');
	VALUES (363, 630, TIMESTAMP WITH TIME ZONE '2020-09-03 09:28:31+00', 'Nos soldados a tudo obedientes,
');
	VALUES (363, 630, TIMESTAMP WITH TIME ZONE '2020-09-03 15:48:45+00', 'Que nunca tirará alheia inveja
');

	VALUES (364, 435, TIMESTAMP WITH TIME ZONE '2020-12-18 23:59:10+00', 'Por Rei, quando da vida se apartou
');

	VALUES (365, 371, TIMESTAMP WITH TIME ZONE '2019-11-01 00:10:40+00', 'Que primeiro desejos o acabaram.
');
	VALUES (365, 371, TIMESTAMP WITH TIME ZONE '2019-11-01 02:30:36+00', 'As Musas agradeça o nosso Gama
');
	VALUES (365, 371, TIMESTAMP WITH TIME ZONE '2019-11-01 06:35:06+00', 'Mas o sombrio vale mais ameno.
');
	VALUES (365, 371, TIMESTAMP WITH TIME ZONE '2019-11-01 12:22:23+00', 'Tal prémio de meus versos me tornassem:
');

	VALUES (366, 372, TIMESTAMP WITH TIME ZONE '2021-01-19 08:34:58+00', 'Por meio destes hórridos perigos,
');
	VALUES (366, 372, TIMESTAMP WITH TIME ZONE '2021-01-19 10:59:55+00', 'Tamanho, que ele só se entende e alcança,
');

	VALUES (367, 372, TIMESTAMP WITH TIME ZONE '2021-02-08 17:13:53+00', 'Chamando-se dos nossos Cabo Verde.
');

	VALUES (368, 373, TIMESTAMP WITH TIME ZONE '2020-01-26 11:36:27+00', 'Que para resistirdes vos armastes,
');

	VALUES (369, 373, TIMESTAMP WITH TIME ZONE '2020-02-12 04:19:55+00', '"Somos, um dos das ilhas lhe tornou,
');
	VALUES (369, 373, TIMESTAMP WITH TIME ZONE '2020-02-12 09:45:01+00', '(Que pelo mundo todo faça espanto)
');
	VALUES (369, 373, TIMESTAMP WITH TIME ZONE '2020-02-12 12:55:47+00', 'Que pelejando está co''o Mauritano.
');
	VALUES (369, 445, TIMESTAMP WITH TIME ZONE '2020-02-12 16:22:13+00', 'No carro ajunta as aves que na vida
');

	VALUES (370, 506, TIMESTAMP WITH TIME ZONE '2021-01-27 18:24:50+00', 'Com quem a fama grande se escurece
');
	VALUES (370, 506, TIMESTAMP WITH TIME ZONE '2021-01-28 00:15:55+00', 'Outra coisa não é que as deleitosas
');

	VALUES (371, 375, TIMESTAMP WITH TIME ZONE '2018-07-07 21:12:17+00', 'A ver-te, ou a servir-te, porque visse
');

	VALUES (372, 376, TIMESTAMP WITH TIME ZONE '2021-04-12 07:31:08+00', 'üa façanha faz esclarecida:
');

	VALUES (373, 376, TIMESTAMP WITH TIME ZONE '2019-06-08 01:10:32+00', 'Tudo render-se ser depois rendido.
');

	VALUES (374, 564, TIMESTAMP WITH TIME ZONE '2020-01-30 22:41:17+00', 'Se dizem, fero Amor, que a sede tua
');
	VALUES (374, 564, TIMESTAMP WITH TIME ZONE '2020-01-31 03:02:05+00', 'Cometendo as bombardas, que, nos ares,
');

	VALUES (375, 666, TIMESTAMP WITH TIME ZONE '2018-10-19 05:47:57+00', 'Mas não deixes no mar as Ilhas onde
');
	VALUES (375, 379, TIMESTAMP WITH TIME ZONE '2018-10-19 12:59:15+00', 'Veio a manhã no céu pintando as cores
');
	VALUES (375, 666, TIMESTAMP WITH TIME ZONE '2018-10-19 17:50:42+00', 'Que com armas virá despois de ti,
');
	VALUES (375, 379, TIMESTAMP WITH TIME ZONE '2018-10-19 23:46:39+00', 'Apousentos de Febo limitados.
');

	VALUES (376, 382, TIMESTAMP WITH TIME ZONE '2019-04-12 00:16:21+00', 'Não longe o porto jaz da nomeada
');
	VALUES (376, 382, TIMESTAMP WITH TIME ZONE '2019-04-12 02:14:37+00', 'Agora o mar, depois o fresco rio.
');

	VALUES (377, 384, TIMESTAMP WITH TIME ZONE '2021-04-08 02:00:29+00', 'Estando fora da água incautamente,
');
	VALUES (377, 391, TIMESTAMP WITH TIME ZONE '2021-04-08 05:50:43+00', 'As gostosas batalhas que ali via.
');

	VALUES (378, 630, TIMESTAMP WITH TIME ZONE '2021-03-22 16:36:48+00', 'O rio que Sevilha vai regando,
');
	VALUES (378, 384, TIMESTAMP WITH TIME ZONE '2021-03-22 19:21:21+00', 'Assim contava o Mouro; mas vagando
');

	VALUES (379, 385, TIMESTAMP WITH TIME ZONE '2021-05-09 10:07:10+00', 'Por filha de Fernando reputada,
');
	VALUES (379, 453, TIMESTAMP WITH TIME ZONE '2021-05-09 14:20:44+00', 'E tudo sem mentir, puras verdades.
');
	VALUES (379, 385, TIMESTAMP WITH TIME ZONE '2021-05-09 16:11:49+00', 'Mas já a amorosa estrela cintilava
');
	VALUES (379, 453, TIMESTAMP WITH TIME ZONE '2021-05-09 20:12:41+00', 'Que cuidar de fazer aos vossos guerra.
');

	VALUES (380, 474, TIMESTAMP WITH TIME ZONE '2019-10-22 19:18:25+00', 'Dos Deuses para os paços caminhava
');

	VALUES (381, 434, TIMESTAMP WITH TIME ZONE '2019-09-20 12:06:41+00', 'Que por nós a do vento que assoprava.
');

	VALUES (382, 387, TIMESTAMP WITH TIME ZONE '2019-02-10 05:03:22+00', 'Se enxerga da Dedálea facultade,
');
	VALUES (382, 402, TIMESTAMP WITH TIME ZONE '2019-02-10 05:45:13+00', 'Abaixam lanças, fere a terra fogo.
');
	VALUES (382, 402, TIMESTAMP WITH TIME ZONE '2019-02-10 12:29:38+00', 'Quando com maior grita ao Rei relatam
');
	VALUES (382, 387, TIMESTAMP WITH TIME ZONE '2019-02-10 17:35:42+00', 'Na cabeça uma fota guarnecida
');

	VALUES (383, 465, TIMESTAMP WITH TIME ZONE '2019-11-08 03:27:33+00', 'E vendo sem vingança tanto dano,
');
	VALUES (383, 390, TIMESTAMP WITH TIME ZONE '2019-11-08 10:42:39+00', 'E se me esperas, não há mais que espere."
');

	VALUES (384, 637, TIMESTAMP WITH TIME ZONE '2021-04-07 03:10:34+00', 'Consolação extrema da mãe velha,
');
	VALUES (384, 391, TIMESTAMP WITH TIME ZONE '2021-04-07 04:43:59+00', 'Porfiam: tinge o ferro o sangue ardente;
');
	VALUES (384, 391, TIMESTAMP WITH TIME ZONE '2021-04-07 11:15:21+00', 'Dali vão em demanda da água pura,
');

	VALUES (385, 504, TIMESTAMP WITH TIME ZONE '2020-06-29 08:10:36+00', 'Do mar a natural ferocidade.
');
	VALUES (385, 504, TIMESTAMP WITH TIME ZONE '2020-06-29 11:26:38+00', 'Daqueles Reis, que foram dilatando
');

	VALUES (386, 393, TIMESTAMP WITH TIME ZONE '2019-05-18 18:40:15+00', 'No seu regaço os Cantos que molhados
');
	VALUES (386, 447, TIMESTAMP WITH TIME ZONE '2019-05-19 02:20:03+00', 'Dos procelosos baxos escapados,
');
	VALUES (386, 447, TIMESTAMP WITH TIME ZONE '2019-05-19 03:40:11+00', 'Os olhos põe no bélico transunto
');

	VALUES (387, 414, TIMESTAMP WITH TIME ZONE '2020-01-23 02:15:50+00', 'Não usado licor, que dá alegria.
');
	VALUES (387, 414, TIMESTAMP WITH TIME ZONE '2020-01-23 03:25:10+00', 'Das águas o poder lhe obedecia.
');

	VALUES (388, 628, TIMESTAMP WITH TIME ZONE '2020-10-29 15:53:08+00', '"Pelas praias vestidos os soldados
');
	VALUES (388, 394, TIMESTAMP WITH TIME ZONE '2020-10-29 19:46:09+00', 'E que entanto podia do trabalho
');
	VALUES (388, 628, TIMESTAMP WITH TIME ZONE '2020-10-30 00:36:51+00', 'Foi juntamente, e o sempre enobrecido
');

	VALUES (389, 641, TIMESTAMP WITH TIME ZONE '2020-12-15 12:20:25+00', 'Que o malévolo Baco lhe ensinara,
');
	VALUES (389, 395, TIMESTAMP WITH TIME ZONE '2020-12-15 15:40:19+00', 'Nem triste hipocrisia val contra ela:
');
	VALUES (389, 641, TIMESTAMP WITH TIME ZONE '2020-12-15 16:41:10+00', 'Este, por sua indústria e engenho raro,
');
	VALUES (389, 641, TIMESTAMP WITH TIME ZONE '2020-12-15 18:48:31+00', 'Ou que os celestes Coros, invocados,
');

	VALUES (390, 428, TIMESTAMP WITH TIME ZONE '2021-01-21 01:27:02+00', 'Mas, para que o desejo acenda o dobre,
');
	VALUES (390, 396, TIMESTAMP WITH TIME ZONE '2021-01-21 02:39:06+00', 'Estão os Traces de robusto peito,
');

	VALUES (391, 396, TIMESTAMP WITH TIME ZONE '2021-03-09 12:38:38+00', 'E de alguns que trazia condenados
');
	VALUES (391, 396, TIMESTAMP WITH TIME ZONE '2021-03-09 14:22:30+00', 'Tudo o que de seus Reinos lhe cumprisse,
');
	VALUES (391, 396, TIMESTAMP WITH TIME ZONE '2021-03-09 15:04:06+00', 'As derradeiras praias que lavavam.
');
	VALUES (391, 396, TIMESTAMP WITH TIME ZONE '2021-03-09 21:02:51+00', 'Pelos peitos as lanças lhe atravessa:
');

	VALUES (392, 641, TIMESTAMP WITH TIME ZONE '2020-12-10 13:45:38+00', 'Do reino lá das terras Iberinas,
');

	VALUES (393, 398, TIMESTAMP WITH TIME ZONE '2019-07-26 08:48:41+00', 'Com quem sempre terás guerras sobejas?
');
	VALUES (393, 398, TIMESTAMP WITH TIME ZONE '2019-07-26 10:32:43+00', '"Esta é por certo a terra que buscais
');
	VALUES (393, 398, TIMESTAMP WITH TIME ZONE '2019-07-26 17:17:08+00', 'Desejar mal a tanta fortaleza.
');

	VALUES (394, 601, TIMESTAMP WITH TIME ZONE '2021-04-06 07:10:21+00', 'Afonso, que não sabe sossegar,
');
	VALUES (394, 399, TIMESTAMP WITH TIME ZONE '2021-04-06 11:38:01+00', 'Nem o mancebo Cocles dos Ausónios,
');

	VALUES (395, 400, TIMESTAMP WITH TIME ZONE '2019-08-09 17:19:03+00', 'Veres o que não pode a vã ciência
');
