	VALUES (471, 474, TIMESTAMP WITH TIME ZONE '2021-02-26 18:39:27+00', 'Águas do Gange, e a terra de Bengala
');
	VALUES (471, 525, TIMESTAMP WITH TIME ZONE '2021-02-26 22:37:31+00', 'A noite negra e feia se alumia
');

	VALUES (472, 477, TIMESTAMP WITH TIME ZONE '2019-01-17 20:34:33+00', 'Por que lhe torne a sua presa gente.
');

	VALUES (473, 478, TIMESTAMP WITH TIME ZONE '2020-10-15 08:33:40+00', 'Dizendo: "Boa viagem", logo o vento
');
	VALUES (473, 478, TIMESTAMP WITH TIME ZONE '2020-10-15 10:48:12+00', 'Braço forte, de gente sublimada,
');
	VALUES (473, 590, TIMESTAMP WITH TIME ZONE '2020-10-15 16:58:08+00', 'Tão incertas viagens e remotas?
');

	VALUES (474, 479, TIMESTAMP WITH TIME ZONE '2020-04-23 15:04:52+00', 'Em ti o remédio certo que queremos.
');

	VALUES (475, 534, TIMESTAMP WITH TIME ZONE '2019-02-09 13:51:16+00', 'Da alva petrina flamas lhe saíam,
');
	VALUES (475, 534, TIMESTAMP WITH TIME ZONE '2019-02-09 13:58:11+00', 'O Capitão que diga: "Não cuidei".
');
	VALUES (475, 479, TIMESTAMP WITH TIME ZONE '2019-02-09 21:53:05+00', 'Almeidas, por quem sempre o Tejo chora;
');
	VALUES (475, 534, TIMESTAMP WITH TIME ZONE '2019-02-10 00:29:23+00', 'Desbaratados, mortos, ou perdidos."
');

	VALUES (476, 480, TIMESTAMP WITH TIME ZONE '2019-02-09 18:14:19+00', 'O invisível Ar, que mais asinha
');
	VALUES (476, 480, TIMESTAMP WITH TIME ZONE '2019-02-09 23:52:03+00', 'E tu, lavrador Mouro, que te enganas,
');
	VALUES (476, 480, TIMESTAMP WITH TIME ZONE '2019-02-10 02:32:36+00', 'Isto dizendo, desce ao mar aberto,
');
	VALUES (476, 480, TIMESTAMP WITH TIME ZONE '2019-02-10 10:15:01+00', 'E dos rios as águas saudosas
');

	VALUES (477, 480, TIMESTAMP WITH TIME ZONE '2020-12-23 08:36:29+00', 'Não é o outro que fica tão manhoso;
');
	VALUES (477, 520, TIMESTAMP WITH TIME ZONE '2020-12-23 14:52:28+00', 'Destemperada e a voz enrouquecida,
');

	VALUES (478, 654, TIMESTAMP WITH TIME ZONE '2020-05-16 11:51:01+00', 'Como por regimento enfim levava,
');
	VALUES (478, 481, TIMESTAMP WITH TIME ZONE '2020-05-16 16:06:45+00', 'Nos costumes, engenhos e ousadia,
');
	VALUES (478, 654, TIMESTAMP WITH TIME ZONE '2020-05-16 17:57:50+00', '"Mais se me ajunta Nicolau Coelho,
');
	VALUES (478, 481, TIMESTAMP WITH TIME ZONE '2020-05-17 00:43:58+00', 'Cozinheiros ocupa e caçadores
');

	VALUES (479, 482, TIMESTAMP WITH TIME ZONE '2019-09-13 11:20:41+00', 'Como próprios da terra, de habitá-la;
');

	VALUES (480, 482, TIMESTAMP WITH TIME ZONE '2018-06-04 11:19:23+00', 'Tocada junto foi de medo e de ira.
');
	VALUES (480, 482, TIMESTAMP WITH TIME ZONE '2018-06-04 14:33:50+00', 'Correm logo os soldados animosos
');
	VALUES (480, 482, TIMESTAMP WITH TIME ZONE '2018-06-04 18:04:24+00', 'Injúria alguma em vosso reino grande,
');
	VALUES (480, 482, TIMESTAMP WITH TIME ZONE '2018-06-04 21:17:39+00', 'A vós, ó geração de Luso, digo,
');

	VALUES (481, 657, TIMESTAMP WITH TIME ZONE '2019-06-20 16:41:34+00', 'Co sopro que nos tanques naturais
');
	VALUES (481, 483, TIMESTAMP WITH TIME ZONE '2019-06-20 17:25:14+00', 'De Cínis e do touro de Perilo"!--
');
	VALUES (481, 657, TIMESTAMP WITH TIME ZONE '2019-06-20 19:36:59+00', 'A natura sem Lei e sem razão.
');

	VALUES (482, 485, TIMESTAMP WITH TIME ZONE '2019-05-14 15:23:27+00', 'Inúmeros peões, d''armas e de ouro
');
	VALUES (482, 485, TIMESTAMP WITH TIME ZONE '2019-05-14 20:58:09+00', 'Com vinhos odoríferos e rosas,
');
	VALUES (482, 484, TIMESTAMP WITH TIME ZONE '2019-05-14 21:35:11+00', 'O próprio Reino queira ver sujeito?
');
	VALUES (482, 484, TIMESTAMP WITH TIME ZONE '2019-05-15 02:33:56+00', 'Que os membros tem regidos da cabeça,
');

	VALUES (483, 484, TIMESTAMP WITH TIME ZONE '2020-01-03 10:52:45+00', 'E navegar meus longos mares ousas,
');
	VALUES (483, 595, TIMESTAMP WITH TIME ZONE '2020-01-03 14:38:58+00', 'Ceres o fruto deixa aos lavradores,
