	VALUES (483, 484, TIMESTAMP WITH TIME ZONE '2020-01-03 16:05:04+00', 'Da boca do facundo Capitão
');
	VALUES (483, 484, TIMESTAMP WITH TIME ZONE '2020-01-03 16:30:32+00', 'Aqui repouso, aqui doce conforto,
');

	VALUES (484, 685, TIMESTAMP WITH TIME ZONE '2019-04-05 08:29:47+00', 'Que todo se desfaz em puro amor.
');
	VALUES (484, 485, TIMESTAMP WITH TIME ZONE '2019-04-05 15:39:57+00', 'Alegres vinham todos, porque crêm
');

	VALUES (485, 611, TIMESTAMP WITH TIME ZONE '2020-11-27 08:54:38+00', 'Para onde a Natureza tinha posta
');
	VALUES (485, 487, TIMESTAMP WITH TIME ZONE '2020-11-27 13:58:12+00', 'A voz pesada um pouco alevantando,
');
	VALUES (485, 611, TIMESTAMP WITH TIME ZONE '2020-11-27 19:36:07+00', 'Em papel o que na alma andar devia.
');
	VALUES (485, 487, TIMESTAMP WITH TIME ZONE '2020-11-27 21:05:44+00', 'Novo pastor, e nova seita inventa:
');

	VALUES (486, 487, TIMESTAMP WITH TIME ZONE '2020-11-18 08:24:20+00', 'A fatídica Cerva que o avisa:
');
	VALUES (486, 487, TIMESTAMP WITH TIME ZONE '2020-11-18 13:39:30+00', 'Numa alma, doce, incógnita alegria,
');
	VALUES (486, 584, TIMESTAMP WITH TIME ZONE '2020-11-18 19:52:23+00', 'Em prémio destes feitos excelentes,
');
	VALUES (486, 487, TIMESTAMP WITH TIME ZONE '2020-11-19 01:17:03+00', 'E se não for contigo socorrido,
');

	VALUES (487, 548, TIMESTAMP WITH TIME ZONE '2021-04-24 06:20:18+00', 'Formosas Ninfas são as que curavam
');

	VALUES (488, 511, TIMESTAMP WITH TIME ZONE '2020-07-10 16:04:16+00', 'Vínculo quer contigo de amizade.
');

	VALUES (489, 492, TIMESTAMP WITH TIME ZONE '2019-12-15 12:54:08+00', 'Que sequer da esperança fosse engano.
');
	VALUES (489, 492, TIMESTAMP WITH TIME ZONE '2019-12-15 18:11:15+00', 'Veloso, sem que alguém lhe ali ajudasse;
');
	VALUES (489, 492, TIMESTAMP WITH TIME ZONE '2019-12-15 21:16:07+00', 'Colos incêndios dos vossos pelejando,
');
	VALUES (489, 562, TIMESTAMP WITH TIME ZONE '2019-12-16 02:25:06+00', 'Eram os Castelhanos oprimidos,
');

	VALUES (490, 492, TIMESTAMP WITH TIME ZONE '2020-01-05 01:49:54+00', 'De nós o claro Sol, para julgares
');
	VALUES (490, 492, TIMESTAMP WITH TIME ZONE '2020-01-05 02:20:54+00', 'São oferecimentos verdadeiros,
');
	VALUES (490, 492, TIMESTAMP WITH TIME ZONE '2020-01-05 07:19:44+00', 'Que a pudessem vender pelo que val.
');

	VALUES (491, 493, TIMESTAMP WITH TIME ZONE '2020-03-29 09:07:11+00', 'Possam dizer que são pera mandados,
');
	VALUES (491, 669, TIMESTAMP WITH TIME ZONE '2020-03-29 09:13:38+00', 'Que, se lá na Ásia Tróia insigne abrasa,
');

	VALUES (492, 493, TIMESTAMP WITH TIME ZONE '2019-09-25 23:12:23+00', 'Dizendo ser sua filha herdeira dela.
');
	VALUES (492, 644, TIMESTAMP WITH TIME ZONE '2019-09-26 03:16:33+00', 'Co sepulcro de Santa Caterina;
');
	VALUES (492, 644, TIMESTAMP WITH TIME ZONE '2019-09-26 04:45:01+00', 'De Assírios, Persas, Gregos e Romanos.
');
	VALUES (492, 493, TIMESTAMP WITH TIME ZONE '2019-09-26 05:41:30+00', 'Despreza o fraco moço mal vestido,
');

	VALUES (493, 627, TIMESTAMP WITH TIME ZONE '2020-11-06 04:24:13+00', 'Possuída de cães, que sempre unidos
');
	VALUES (493, 627, TIMESTAMP WITH TIME ZONE '2020-11-06 08:55:01+00', '"Mas logo ao outro dia, seus parceiros,
');
	VALUES (493, 627, TIMESTAMP WITH TIME ZONE '2020-11-06 12:57:19+00', 'Aquelas invenções feras e novas
');

	VALUES (494, 692, TIMESTAMP WITH TIME ZONE '2019-11-01 06:43:14+00', 'Em que o Rei Castelhano já aguardava
');
	VALUES (494, 496, TIMESTAMP WITH TIME ZONE '2019-11-01 08:12:07+00', 'Co''os ciúmes da vaca, arreceosos,
');
	VALUES (494, 692, TIMESTAMP WITH TIME ZONE '2019-11-01 08:36:31+00', 'Com força tira; e, deste único tiro,
');

	VALUES (495, 588, TIMESTAMP WITH TIME ZONE '2020-08-19 02:49:32+00', 'Trombeta de seu pai, e seu correio.
');

	VALUES (496, 498, TIMESTAMP WITH TIME ZONE '2019-08-07 13:56:52+00', 'Mas inda doutro estado mais que humano
');
	VALUES (496, 542, TIMESTAMP WITH TIME ZONE '2019-08-07 18:23:40+00', 'Para a ilha, a que Vénus as guiava.
');
	VALUES (496, 542, TIMESTAMP WITH TIME ZONE '2019-08-07 20:41:19+00', 'Os trabalhos, que pelo Deus nascido
');

	VALUES (497, 500, TIMESTAMP WITH TIME ZONE '2020-07-12 03:33:10+00', 'Liberal, cavaleiro, enamorado,
');
	VALUES (497, 500, TIMESTAMP WITH TIME ZONE '2020-07-12 05:35:23+00', 'Mas não sem cor, contudo, de virtude.
');

	VALUES (498, 615, TIMESTAMP WITH TIME ZONE '2021-03-13 03:55:38+00', 'Esconde o corpo n''água; outra se apressa
');
	VALUES (498, 501, TIMESTAMP WITH TIME ZONE '2021-03-13 04:00:12+00', 'Quem contra o Rei e a Pátria se alevanta:
');
	VALUES (498, 615, TIMESTAMP WITH TIME ZONE '2021-03-13 07:07:48+00', 'Dos que a tanto desejam, sendo alheia.
');
	VALUES (498, 615, TIMESTAMP WITH TIME ZONE '2021-03-13 07:31:16+00', 'Tanto um peito soberbo e insolente,
');

	VALUES (499, 502, TIMESTAMP WITH TIME ZONE '2020-12-18 19:57:47+00', 'Salta, corre, sibila, acena, e brada,
');
	VALUES (499, 502, TIMESTAMP WITH TIME ZONE '2020-12-18 22:19:36+00', 'Elas, que vão do doce amor vencidas,
');
	VALUES (499, 503, TIMESTAMP WITH TIME ZONE '2020-12-19 02:05:39+00', 'Morrem, arrenegando o Céu e os fados.
');
	VALUES (499, 502, TIMESTAMP WITH TIME ZONE '2020-12-19 05:32:58+00', 'E guarde-se não seja ainda comido
');

	VALUES (500, 535, TIMESTAMP WITH TIME ZONE '2021-01-14 04:03:09+00', 'Lhe diz:--"Quando o direito pretendia
');
	VALUES (500, 535, TIMESTAMP WITH TIME ZONE '2021-01-14 08:57:41+00', 'Os que ao Rei e à Lei servem de muro!
');
	VALUES (500, 502, TIMESTAMP WITH TIME ZONE '2021-01-14 11:32:16+00', 'De amor feridas, para lhes entregarem
');
	VALUES (500, 535, TIMESTAMP WITH TIME ZONE '2021-01-14 15:24:24+00', 'Que para um cavaleiro houvesse cento.
');

	VALUES (501, 503, TIMESTAMP WITH TIME ZONE '2021-05-26 13:41:01+00', 'Exemplos mil se vêem de amor nefando,
');
	VALUES (501, 503, TIMESTAMP WITH TIME ZONE '2021-05-26 18:53:06+00', 'Logo na retaguarda não se esconde
');
	VALUES (501, 503, TIMESTAMP WITH TIME ZONE '2021-05-26 22:39:38+00', 'Achava muito contrários pareceres;
');
	VALUES (501, 547, TIMESTAMP WITH TIME ZONE '2021-05-27 01:56:48+00', 'De Argos, da Hidra a luz, da Lebre e da Ara.
');

	VALUES (502, 504, TIMESTAMP WITH TIME ZONE '2021-02-04 03:50:31+00', 'Como os que, só das línguas que caíram,
');
	VALUES (502, 525, TIMESTAMP WITH TIME ZONE '2021-02-04 09:08:23+00', 'Das naus o falso Mouro despedido,
');

	VALUES (503, 686, TIMESTAMP WITH TIME ZONE '2020-06-27 18:50:14+00', 'Da soberba Tui, que a mesma sorte
');
	VALUES (503, 504, TIMESTAMP WITH TIME ZONE '2020-06-27 21:29:20+00', 'Entres a barra, tu com toda armada:
');
	VALUES (503, 686, TIMESTAMP WITH TIME ZONE '2020-06-28 01:25:35+00', 'Que o vagabundo Aleides ou Teseu.
');

	VALUES (504, 541, TIMESTAMP WITH TIME ZONE '2020-07-18 20:42:51+00', 'Mais descobrimos do que humano espírito
');
	VALUES (504, 505, TIMESTAMP WITH TIME ZONE '2020-07-18 23:48:45+00', 'Tornar-se facilmente não podia:
');
	VALUES (504, 541, TIMESTAMP WITH TIME ZONE '2020-07-19 01:39:32+00', 'Ou quem o Tribo ilustre destruiu
');
	VALUES (504, 505, TIMESTAMP WITH TIME ZONE '2020-07-19 07:57:10+00', 'Faz tredores e falsos os amigos:
');

	VALUES (505, 616, TIMESTAMP WITH TIME ZONE '2021-03-10 09:57:08+00', 'De Luso, ou Lisa, que de Baco antigo
');
	VALUES (505, 616, TIMESTAMP WITH TIME ZONE '2021-03-10 17:20:39+00', 'Que o fraco poder vosso não pesais;
');
	VALUES (505, 616, TIMESTAMP WITH TIME ZONE '2021-03-10 22:54:48+00', 'Mas o pior de tudo é que a ventura
');
	VALUES (505, 506, TIMESTAMP WITH TIME ZONE '2021-03-11 00:57:22+00', 'Longos do mar, vêm sórdidas e imundas.
');

	VALUES (506, 689, TIMESTAMP WITH TIME ZONE '2020-09-21 06:43:08+00', 'Depois de ter com os Mouros superado,
');

	VALUES (507, 508, TIMESTAMP WITH TIME ZONE '2020-02-12 10:20:28+00', 'Duro freio porá, e a toda a terra
');
	VALUES (507, 508, TIMESTAMP WITH TIME ZONE '2020-02-12 17:59:53+00', '"Era maior a força em demasia,
');
	VALUES (507, 508, TIMESTAMP WITH TIME ZONE '2020-02-12 23:18:52+00', 'A fortuna das forças Africanas,
');

	VALUES (508, 601, TIMESTAMP WITH TIME ZONE '2021-04-19 06:30:59+00', 'Que vinte Babilónias que tomara.
');

	VALUES (509, 567, TIMESTAMP WITH TIME ZONE '2020-08-02 21:46:00+00', 'Não parte o Gama enfim, que lho defende
');

	VALUES (510, 510, TIMESTAMP WITH TIME ZONE '2020-06-28 00:36:43+00', 'Na praia com os batéis, como ordenara.
