	VALUES (511, 511, TIMESTAMP WITH TIME ZONE '2020-08-09 12:09:36+00', 'Mas do seu Rei defende a cara vida,
');
	VALUES (511, 511, TIMESTAMP WITH TIME ZONE '2020-08-09 17:01:22+00', 'Mas mais de Dom Nuno Alvares se arreia:
');
	VALUES (511, 559, TIMESTAMP WITH TIME ZONE '2020-08-09 23:51:50+00', 'A laranjeira tem no fruto lindo
');

	VALUES (512, 695, TIMESTAMP WITH TIME ZONE '2020-07-30 04:07:19+00', '"Em nenhuma outra cousa confiado,
');

	VALUES (513, 619, TIMESTAMP WITH TIME ZONE '2020-07-02 10:21:29+00', 'Que a fortuna não deixa durar muito,
');
	VALUES (513, 619, TIMESTAMP WITH TIME ZONE '2020-07-02 13:29:07+00', '"Vês o extremo Suez, que antigamente
');
	VALUES (513, 619, TIMESTAMP WITH TIME ZONE '2020-07-02 13:34:56+00', 'Sem achar resistência, nem defesa.
');

	VALUES (514, 512, TIMESTAMP WITH TIME ZONE '2019-03-24 10:48:04+00', 'Debaixo do Horizonte e luminosa
');
	VALUES (514, 512, TIMESTAMP WITH TIME ZONE '2019-03-24 14:56:56+00', 'Entre os quais tem o ceptro imperial;
');
	VALUES (514, 512, TIMESTAMP WITH TIME ZONE '2019-03-24 22:53:47+00', '"Também movem da guerra as negras fúrias
');
	VALUES (514, 512, TIMESTAMP WITH TIME ZONE '2019-03-25 03:13:09+00', '"Porém, como a luz crástina chegada
');

	VALUES (515, 534, TIMESTAMP WITH TIME ZONE '2019-02-05 19:47:21+00', 'Para servir a seu desejo feio,
');

	VALUES (516, 514, TIMESTAMP WITH TIME ZONE '2020-10-16 00:52:40+00', 'Padecerá, pola Fé santa sua.
');
	VALUES (516, 514, TIMESTAMP WITH TIME ZONE '2020-10-16 06:20:03+00', 'Lhe disse eu:--Quem és tu? que esse estupendo
');

	VALUES (517, 517, TIMESTAMP WITH TIME ZONE '2021-03-17 10:25:49+00', 'Ao Catual, que dele tinha cargo,
');
	VALUES (517, 611, TIMESTAMP WITH TIME ZONE '2021-03-17 13:39:29+00', 'Eneias e Quirino, e os dois Tebanos,
');
	VALUES (517, 517, TIMESTAMP WITH TIME ZONE '2021-03-17 15:52:30+00', 'Ponde no chão: vereis um novo exemplo
');

	VALUES (518, 517, TIMESTAMP WITH TIME ZONE '2021-04-19 15:53:04+00', 'Como inda agora faz a gente inica.
');
	VALUES (518, 559, TIMESTAMP WITH TIME ZONE '2021-04-19 17:05:14+00', 'Agora pelos úmidos caminhos.
');
	VALUES (518, 517, TIMESTAMP WITH TIME ZONE '2021-04-19 20:38:31+00', 'Assim que sempre, enfim, com fama e glória,
');

	VALUES (519, 605, TIMESTAMP WITH TIME ZONE '2020-07-29 02:55:21+00', 'Para estorvar que a armada não chegasse
');
	VALUES (519, 605, TIMESTAMP WITH TIME ZONE '2020-07-29 06:53:54+00', 'Os Laos, em terra e número potentes;
');
	VALUES (519, 518, TIMESTAMP WITH TIME ZONE '2020-07-29 07:13:36+00', '"Mas já o Planeta que no céu primeiro
');

	VALUES (520, 518, TIMESTAMP WITH TIME ZONE '2020-06-25 22:04:24+00', 'Haverá que resista, se Lisboa
');
	VALUES (520, 591, TIMESTAMP WITH TIME ZONE '2020-06-26 01:24:00+00', 'Mas debaixo o veneno vem coberto;
');
	VALUES (520, 518, TIMESTAMP WITH TIME ZONE '2020-06-26 08:13:33+00', 'Nem nega que esse nome preminente
');
	VALUES (520, 591, TIMESTAMP WITH TIME ZONE '2020-06-26 13:47:42+00', 'Menos trabalho em tal negócio gasta:
');

	VALUES (521, 520, TIMESTAMP WITH TIME ZONE '2020-11-09 03:30:14+00', 'Da gente a salvas pérfida e malina,
');
	VALUES (521, 520, TIMESTAMP WITH TIME ZONE '2020-11-09 06:33:05+00', 'Mostra a Fortuna injusta seus poderes.
');
	VALUES (521, 613, TIMESTAMP WITH TIME ZONE '2020-11-09 12:13:13+00', 'Com que a seu jugo e lei someteria
');

	VALUES (522, 520, TIMESTAMP WITH TIME ZONE '2020-11-09 03:58:36+00', 'Com jejuns, disciplina, pelos vícios
');
	VALUES (522, 520, TIMESTAMP WITH TIME ZONE '2020-11-09 11:17:18+00', 'Veja a batalha e os seus esforce e anime;
');
	VALUES (522, 520, TIMESTAMP WITH TIME ZONE '2020-11-09 11:27:31+00', 'Pirene se alevantam, que segundo
