	VALUES (523, 522, TIMESTAMP WITH TIME ZONE '2020-10-17 17:24:53+00', 'O Capitão, o logo as velas dando,
');

	VALUES (524, 660, TIMESTAMP WITH TIME ZONE '2019-12-23 02:01:13+00', 'Ante tempo falando o nomeou;
