	VALUES (524, 660, TIMESTAMP WITH TIME ZONE '2019-12-23 08:01:27+00', 'Iam-se as sombras lentas desfazendo,
');
	VALUES (524, 523, TIMESTAMP WITH TIME ZONE '2019-12-23 13:20:09+00', 'Em lugar das guerreiras azagaias
');

	VALUES (525, 523, TIMESTAMP WITH TIME ZONE '2021-01-31 04:03:30+00', 'Sem quem não quis Amor que viver possa,
');
	VALUES (525, 523, TIMESTAMP WITH TIME ZONE '2021-01-31 10:59:48+00', 'Tinha uma volta dado o Sol ardente
');
	VALUES (525, 641, TIMESTAMP WITH TIME ZONE '2021-01-31 12:28:20+00', 'Fazendo ser manjar acostumado
');

	VALUES (526, 607, TIMESTAMP WITH TIME ZONE '2018-09-25 08:12:22+00', 'Dos inimigos a terra lhe corria,
');

	VALUES (527, 524, TIMESTAMP WITH TIME ZONE '2020-08-05 18:53:35+00', 'De disforme e grandíssima estatura,
');
	VALUES (527, 609, TIMESTAMP WITH TIME ZONE '2020-08-05 23:08:01+00', 'A rédea larga às aves, cujo canto
');
	VALUES (527, 609, TIMESTAMP WITH TIME ZONE '2020-08-05 23:30:58+00', 'Em que o Rei Castelhano já aguardava
');

	VALUES (528, 526, TIMESTAMP WITH TIME ZONE '2019-11-27 09:54:13+00', 'Do Lusitano espírito demande
