	VALUES (528, 688, TIMESTAMP WITH TIME ZONE '2019-11-27 13:56:36+00', 'Pelo Cunha também, que nunca extinto
');
	VALUES (528, 526, TIMESTAMP WITH TIME ZONE '2019-11-27 17:50:54+00', 'Dá sobre o Rei que cerca a vila forte?
');
	VALUES (528, 688, TIMESTAMP WITH TIME ZONE '2019-11-27 22:02:54+00', '"Foram de Emanuel remunerados,
');

	VALUES (529, 550, TIMESTAMP WITH TIME ZONE '2019-03-13 23:31:04+00', 'Enfim, não houve forte capitão,
');
	VALUES (529, 526, TIMESTAMP WITH TIME ZONE '2019-03-14 02:26:59+00', 'A fortuna mo traz peregrinando,
