	VALUES (530, 528, TIMESTAMP WITH TIME ZONE '2020-05-03 04:30:43+00', 'A matar na água o fogo que nele arde.
');
	VALUES (530, 528, TIMESTAMP WITH TIME ZONE '2020-05-03 05:42:45+00', 'Santo que os Espanhóis tanto ajudou
');

	VALUES (531, 591, TIMESTAMP WITH TIME ZONE '2019-05-14 02:47:50+00', 'O conselho infernal dos Maumetanos,
');

	VALUES (532, 616, TIMESTAMP WITH TIME ZONE '2019-09-13 20:11:40+00', 'Lhe maquinava, nada lhe concede,
