	VALUES (532, 616, TIMESTAMP WITH TIME ZONE '2019-09-13 22:25:20+00', 'Quanto já foi aos Gregos o Troiano.
');
	VALUES (532, 531, TIMESTAMP WITH TIME ZONE '2019-09-13 22:45:27+00', 'Da menina que a trouxe na capela,
');

	VALUES (533, 641, TIMESTAMP WITH TIME ZONE '2021-02-06 03:09:24+00', 'E das damas servidos e amimados.
');
	VALUES (533, 532, TIMESTAMP WITH TIME ZONE '2021-02-06 09:51:00+00', 'Cuidam que seus enganos são sabidos,
');

	VALUES (534, 574, TIMESTAMP WITH TIME ZONE '2019-12-21 13:15:08+00', '"Olha, em Ceilão, que o monte se alevanta
');
	VALUES (534, 533, TIMESTAMP WITH TIME ZONE '2019-12-21 16:54:40+00', 'Possa a terra mandar qualquer fazenda,
');
	VALUES (534, 533, TIMESTAMP WITH TIME ZONE '2019-12-21 18:22:01+00', 'Nem sou da terra, nem da geração
');

	VALUES (535, 672, TIMESTAMP WITH TIME ZONE '2021-02-01 14:15:45+00', 'Do conhecido pólo de Calisto,
');
	VALUES (535, 672, TIMESTAMP WITH TIME ZONE '2021-02-01 16:27:26+00', 'A terra dos Algarves, e já nela
');
	VALUES (535, 533, TIMESTAMP WITH TIME ZONE '2021-02-02 00:11:07+00', 'Que de inimigos mil verá coalhado.
');
	VALUES (535, 672, TIMESTAMP WITH TIME ZONE '2021-02-02 07:33:59+00', 'Que não tenham inveja às de Hipoerene.
');

	VALUES (536, 693, TIMESTAMP WITH TIME ZONE '2020-06-02 07:47:05+00', 'Mas quantos a meu Rei forem contrários."--
');
	VALUES (536, 534, TIMESTAMP WITH TIME ZONE '2020-06-02 08:53:06+00', '"Este, depois que contra os descendentes
');
	VALUES (536, 693, TIMESTAMP WITH TIME ZONE '2020-06-02 15:25:31+00', 'Mas antes, tendo livre a fantasia,
');

	VALUES (537, 646, TIMESTAMP WITH TIME ZONE '2020-05-10 21:39:11+00', 'Sancho, d''esforço o d''ânimo sobejo,
');
	VALUES (537, 535, TIMESTAMP WITH TIME ZONE '2020-05-11 04:43:37+00', '"Vês Europa Cristã, mais alta e clara
');

	VALUES (538, 570, TIMESTAMP WITH TIME ZONE '2019-07-19 10:17:48+00', 'Cumprido esse desejo te seria;
');
	VALUES (538, 570, TIMESTAMP WITH TIME ZONE '2019-07-19 13:00:57+00', 'Em quem o esforço antigo se converte
');
	VALUES (538, 570, TIMESTAMP WITH TIME ZONE '2019-07-19 16:11:21+00', 'A massa, ao mundo oculta e preciosa.
');
	VALUES (538, 536, TIMESTAMP WITH TIME ZONE '2019-07-19 18:25:05+00', 'Da espessa mata, ou tímida gazela;
');

	VALUES (539, 688, TIMESTAMP WITH TIME ZONE '2019-11-23 11:44:43+00', 'O que deu para dar-se a natureza.
');

	VALUES (540, 538, TIMESTAMP WITH TIME ZONE '2021-02-03 08:29:53+00', 'Mas um só, que Magriço se dizia,
');
	VALUES (540, 538, TIMESTAMP WITH TIME ZONE '2021-02-03 14:17:08+00', 'Adivinhar perigos, e evitá-los:
');

	VALUES (541, 538, TIMESTAMP WITH TIME ZONE '2021-01-07 20:30:08+00', 'As forças exercitam, de inimigas
');
	VALUES (541, 619, TIMESTAMP WITH TIME ZONE '2021-01-07 21:52:44+00', 'Mostrara rosto angélico e sereno,
');

	VALUES (542, 667, TIMESTAMP WITH TIME ZONE '2021-02-27 10:00:20+00', 'Afonso, que não sabe sossegar,
');
	VALUES (542, 667, TIMESTAMP WITH TIME ZONE '2021-02-27 11:43:10+00', 'Posto que rica e posto que assentada
');

	VALUES (543, 622, TIMESTAMP WITH TIME ZONE '2021-02-09 14:45:07+00', 'De minha temerária confiança,
');
	VALUES (543, 622, TIMESTAMP WITH TIME ZONE '2021-02-09 18:43:49+00', '"Divina Guarda, angélica, celeste,
');

	VALUES (544, 556, TIMESTAMP WITH TIME ZONE '2020-01-20 15:44:11+00', 'Da primeira marítima vitória.
');
	VALUES (544, 556, TIMESTAMP WITH TIME ZONE '2020-01-20 18:17:10+00', 'Os pés e mãos parece que lhe ataram
');
	VALUES (544, 541, TIMESTAMP WITH TIME ZONE '2020-01-20 18:23:19+00', 'Povoações que a parte Africa tem
');
	VALUES (544, 541, TIMESTAMP WITH TIME ZONE '2020-01-20 21:37:19+00', 'Toda banhada em riso e alegria,
');

	VALUES (545, 541, TIMESTAMP WITH TIME ZONE '2018-07-02 13:55:58+00', 'Por que, saindo nós para tomá-lo,
');
	VALUES (545, 559, TIMESTAMP WITH TIME ZONE '2018-07-02 14:43:37+00', 'Sereis entre os Heróis esclarecidos,
');
	VALUES (545, 559, TIMESTAMP WITH TIME ZONE '2018-07-02 16:56:50+00', 'As mulheres c''um choro piedoso,
');
	VALUES (545, 559, TIMESTAMP WITH TIME ZONE '2018-07-02 17:14:53+00', 'A nobre ira lhe vinha prometendo
');

	VALUES (546, 542, TIMESTAMP WITH TIME ZONE '2019-09-18 17:17:30+00', 'Me tornes do que escrevo, e em vão pretendo,
');
	VALUES (546, 542, TIMESTAMP WITH TIME ZONE '2019-09-18 21:37:31+00', 'Trabalhando, cantando estão de amores,
');

	VALUES (547, 618, TIMESTAMP WITH TIME ZONE '2019-09-09 12:14:13+00', 'E de metais ornados reluzentes,
');
	VALUES (547, 618, TIMESTAMP WITH TIME ZONE '2019-09-09 12:37:46+00', 'No gosto da cobiça e na rudeza
');
	VALUES (547, 618, TIMESTAMP WITH TIME ZONE '2019-09-09 15:36:22+00', 'Que não é prémio vil ser conhecido
');

	VALUES (548, 552, TIMESTAMP WITH TIME ZONE '2020-06-04 03:46:03+00', 'Nem com lágrimas tristes se mitiga,
');

	VALUES (549, 684, TIMESTAMP WITH TIME ZONE '2019-07-31 14:29:52+00', 'De mais não celebrar nenhum de Roma.
');
	VALUES (549, 684, TIMESTAMP WITH TIME ZONE '2019-07-31 18:42:21+00', 'Porque já lhe dissera, deste jeito,
');

	VALUES (550, 652, TIMESTAMP WITH TIME ZONE '2020-09-18 21:18:47+00', 'A Briareu parece que imitava;
');
	VALUES (550, 546, TIMESTAMP WITH TIME ZONE '2020-09-19 02:33:45+00', 'Régulo, porque a pátria não perdesse,
');
	VALUES (550, 652, TIMESTAMP WITH TIME ZONE '2020-09-19 05:40:37+00', 'Em que o Rei Castelhano já aguardava
');
	VALUES (550, 652, TIMESTAMP WITH TIME ZONE '2020-09-19 06:30:45+00', 'Abrindo-o, vence as ondas e os perigos,
');

	VALUES (551, 546, TIMESTAMP WITH TIME ZONE '2020-09-25 07:50:50+00', 'As Musas agradeça o nosso Gama
');
	VALUES (551, 577, TIMESTAMP WITH TIME ZONE '2020-09-25 10:31:38+00', 'Quando às iras do vento o mar responde,
');
	VALUES (551, 546, TIMESTAMP WITH TIME ZONE '2020-09-25 11:41:52+00', 'Não nos apanhasse a água da enseada,
');
	VALUES (551, 577, TIMESTAMP WITH TIME ZONE '2020-09-25 13:16:51+00', 'F, só fica por bem-aventurado
');

	VALUES (552, 575, TIMESTAMP WITH TIME ZONE '2021-05-09 12:07:39+00', 'Novo remédio em terra busca e toma:
');
	VALUES (552, 575, TIMESTAMP WITH TIME ZONE '2021-05-09 15:55:58+00', 'Estava a ilha à terra tão chegada,
');
	VALUES (552, 575, TIMESTAMP WITH TIME ZONE '2021-05-09 16:56:35+00', 'De regerdes os povos, que o desejam,
');

	VALUES (553, 694, TIMESTAMP WITH TIME ZONE '2020-10-06 21:17:16+00', 'Ser esta vida cousa tão pequena.
');

	VALUES (554, 551, TIMESTAMP WITH TIME ZONE '2020-07-31 11:51:10+00', 'Que ameaço divino, ou que segredo
');
	VALUES (554, 551, TIMESTAMP WITH TIME ZONE '2020-07-31 11:52:40+00', 'A de Melique Iaz, acautelada,
');
	VALUES (554, 551, TIMESTAMP WITH TIME ZONE '2020-07-31 12:29:29+00', 'Ou se lha dão a ela as belas flores.
');

	VALUES (555, 551, TIMESTAMP WITH TIME ZONE '2020-12-04 04:44:06+00', 'Dão mais que a mil, que esforço e saber tenham.
');
	VALUES (555, 653, TIMESTAMP WITH TIME ZONE '2020-12-04 09:28:12+00', 'Dizer-te disto mais, não saberia;
');
	VALUES (555, 653, TIMESTAMP WITH TIME ZONE '2020-12-04 11:45:26+00', 'De Luso não perdeis o pensamento,
');
	VALUES (555, 551, TIMESTAMP WITH TIME ZONE '2020-12-04 12:01:11+00', 'Como já o fero Huno o foi primeiro
');

	VALUES (556, 667, TIMESTAMP WITH TIME ZONE '2020-05-01 14:40:58+00', 'Calíope não tem por tão amiga,
');
	VALUES (556, 553, TIMESTAMP WITH TIME ZONE '2020-05-01 21:50:15+00', 'Depois que sossegado e livre o teve
');
	VALUES (556, 553, TIMESTAMP WITH TIME ZONE '2020-05-01 22:49:48+00', 'Tu, claro Tejo, regas tão sereno.
');

	VALUES (557, 578, TIMESTAMP WITH TIME ZONE '2020-04-07 11:37:45+00', 'Vendo como diante ameaçando
');
	VALUES (557, 553, TIMESTAMP WITH TIME ZONE '2020-04-07 12:11:10+00', 'Do morto Conde ao mundo descobriu,
');
	VALUES (557, 578, TIMESTAMP WITH TIME ZONE '2020-04-07 18:33:21+00', 'Aqui, minha Calíope, te invoco
');
	VALUES (557, 553, TIMESTAMP WITH TIME ZONE '2020-04-07 22:00:59+00', 'De ir ajudar o pai ambicioso,
');

	VALUES (558, 693, TIMESTAMP WITH TIME ZONE '2020-06-13 14:03:12+00', 'Estão virgíneas tetas imitando.
');
	VALUES (558, 693, TIMESTAMP WITH TIME ZONE '2020-06-13 20:05:55+00', '"Mastigam os cavalos, escumando,
');
	VALUES (558, 554, TIMESTAMP WITH TIME ZONE '2020-06-14 02:16:12+00', 'Se defendem milhor dos inimigos;
');

	VALUES (559, 598, TIMESTAMP WITH TIME ZONE '2020-01-30 20:54:54+00', 'Mouro, que por piloto à nau lhe mande,
');
	VALUES (559, 598, TIMESTAMP WITH TIME ZONE '2020-01-30 23:24:46+00', 'A pisar do Monde-o a fértil erva.
');

	VALUES (560, 622, TIMESTAMP WITH TIME ZONE '2019-12-12 08:33:59+00', 'Ela, por onde passa, o ar e o vento
');
	VALUES (560, 556, TIMESTAMP WITH TIME ZONE '2019-12-12 15:59:52+00', 'E aqueles onde sempre sopra Eolo,
');

	VALUES (561, 557, TIMESTAMP WITH TIME ZONE '2019-07-21 05:27:26+00', 'Abrantes vila toma, acompanhado
');
	VALUES (561, 603, TIMESTAMP WITH TIME ZONE '2019-07-21 11:34:50+00', 'E não convém furor a firme amante.
');
	VALUES (561, 603, TIMESTAMP WITH TIME ZONE '2019-07-21 12:27:05+00', 'Sem que ache resistência nem perigos,
');

	VALUES (562, 557, TIMESTAMP WITH TIME ZONE '2018-10-30 07:31:08+00', 'As espadas banhando, e as brancas flores,
');
	VALUES (562, 557, TIMESTAMP WITH TIME ZONE '2018-10-30 12:35:24+00', '"Verás defronte estar do Roxo Estreito
');
	VALUES (562, 564, TIMESTAMP WITH TIME ZONE '2018-10-30 14:24:25+00', 'Do mar ingente para a pátria amada,
');

	VALUES (563, 641, TIMESTAMP WITH TIME ZONE '2020-12-30 07:19:48+00', '"Cometeram soberbos os Gigantes,
');
	VALUES (563, 641, TIMESTAMP WITH TIME ZONE '2020-12-30 12:37:41+00', 'Que obedecerá logo à voz sagrada,
');

	VALUES (564, 677, TIMESTAMP WITH TIME ZONE '2021-01-30 14:28:24+00', 'Que do muito arvoredo assim se chama,
');
	VALUES (564, 559, TIMESTAMP WITH TIME ZONE '2021-01-30 15:21:18+00', 'Que com tanta miséria e adversidade
');
	VALUES (564, 559, TIMESTAMP WITH TIME ZONE '2021-01-30 20:13:04+00', 'Os fortes Portugueses incitando.
');
	VALUES (564, 677, TIMESTAMP WITH TIME ZONE '2021-01-31 02:36:31+00', 'Pois que de Luso vem, seu tão privado;
');

	VALUES (565, 631, TIMESTAMP WITH TIME ZONE '2018-12-03 13:50:00+00', 'Senão o de seus passados, até morte.
');
	VALUES (565, 631, TIMESTAMP WITH TIME ZONE '2018-12-03 17:20:25+00', 'Gasalhado seguro te daria,
');

	VALUES (566, 664, TIMESTAMP WITH TIME ZONE '2021-02-08 20:13:59+00', 'Pálida a cor, o gesto amortecido.
');
	VALUES (566, 664, TIMESTAMP WITH TIME ZONE '2021-02-09 00:57:19+00', 'Várias gentes, e leis, e várias manhas.
');
	VALUES (566, 664, TIMESTAMP WITH TIME ZONE '2021-02-09 04:07:33+00', 'Se não cresses a quem não crer devias.
');

	VALUES (567, 561, TIMESTAMP WITH TIME ZONE '2019-11-15 04:37:51+00', 'Rios de ouro e de prata então correram.
');
	VALUES (567, 611, TIMESTAMP WITH TIME ZONE '2019-11-15 09:33:39+00', 'Tantos Cães não imbeles profligados,
');

	VALUES (568, 679, TIMESTAMP WITH TIME ZONE '2021-02-11 15:50:47+00', 'Em louvor do ilustríssimo Albuquerque,
');

	VALUES (569, 562, TIMESTAMP WITH TIME ZONE '2019-11-11 07:26:54+00', 'Octávio, entre as maiores opressões,
');

	VALUES (570, 563, TIMESTAMP WITH TIME ZONE '2020-12-28 01:58:52+00', 'E nobres cortesãos, acaso um dia
');
	VALUES (570, 563, TIMESTAMP WITH TIME ZONE '2020-12-28 06:54:20+00', 'Que as costas dê, mas antes na espessura
');

	VALUES (571, 627, TIMESTAMP WITH TIME ZONE '2018-10-23 13:31:43+00', 'Mais bravos e mais feros se conhecem,
');
	VALUES (571, 564, TIMESTAMP WITH TIME ZONE '2018-10-23 19:47:30+00', 'Versos; isso só louva, isso deseja.
');
	VALUES (571, 564, TIMESTAMP WITH TIME ZONE '2018-10-23 22:59:12+00', 'Das areias ali de prata fina;
');

	VALUES (572, 564, TIMESTAMP WITH TIME ZONE '2019-10-03 21:14:58+00', 'Feliz, deixando a Pétrea e a Deserta.
');
	VALUES (572, 564, TIMESTAMP WITH TIME ZONE '2019-10-03 21:57:09+00', 'Rendendo-se à vontade do inimigo,
');
	VALUES (572, 564, TIMESTAMP WITH TIME ZONE '2019-10-04 03:02:13+00', 'Assim do céu deitadas são as sortes,
');
	VALUES (572, 564, TIMESTAMP WITH TIME ZONE '2019-10-04 05:22:09+00', 'Que se tornem às naus; e por que a fama
');

	VALUES (573, 695, TIMESTAMP WITH TIME ZONE '2018-05-17 00:03:22+00', 'Mas, não querendo a Deusa guardadora,
');
	VALUES (573, 565, TIMESTAMP WITH TIME ZONE '2018-05-17 05:01:09+00', 'Este interpreta mais que sutilmente.
');
	VALUES (573, 565, TIMESTAMP WITH TIME ZONE '2018-05-17 09:08:50+00', '"O batel de Coelho foi depressa
');
	VALUES (573, 565, TIMESTAMP WITH TIME ZONE '2018-05-17 13:59:19+00', 'Em pago dos passados malefícios.
');

	VALUES (574, 649, TIMESTAMP WITH TIME ZONE '2020-02-29 19:18:39+00', 'E as trombetas canoras lhe tangiam;
');
	VALUES (574, 649, TIMESTAMP WITH TIME ZONE '2020-03-01 02:56:44+00', 'De lhe serem leais esta viagem.
');

	VALUES (575, 568, TIMESTAMP WITH TIME ZONE '2020-07-19 22:31:26+00', 'Eram de várias terras conduzidos,
');
	VALUES (575, 568, TIMESTAMP WITH TIME ZONE '2020-07-20 00:19:18+00', 'Com o sangue de seus donos Castelhano.
');

	VALUES (576, 569, TIMESTAMP WITH TIME ZONE '2019-04-07 21:31:27+00', 'Um mancebo de Assíria, um de Judeia.
');
	VALUES (576, 569, TIMESTAMP WITH TIME ZONE '2019-04-08 04:06:53+00', 'Porque uns poucos a terra lhe detêm.
');

	VALUES (577, 654, TIMESTAMP WITH TIME ZONE '2020-04-17 18:35:52+00', 'Mil árvores estão ao céu subindo,
');
	VALUES (577, 654, TIMESTAMP WITH TIME ZONE '2020-04-17 21:14:17+00', 'Ou por segredos que homem não conhece,
');
	VALUES (577, 654, TIMESTAMP WITH TIME ZONE '2020-04-17 23:49:41+00', '"Destes Anrique, dizem que segundo
');

	VALUES (578, 574, TIMESTAMP WITH TIME ZONE '2018-07-15 02:27:55+00', 'E tornando-se, logo se emboscaram,
');

	VALUES (579, 599, TIMESTAMP WITH TIME ZONE '2020-11-12 01:26:14+00', 'O Capitão, que já lhe então convinha
');

	VALUES (580, 575, TIMESTAMP WITH TIME ZONE '2021-05-12 15:14:00+00', 'Da boca dos pequenos sei, contudo,
');

	VALUES (581, 579, TIMESTAMP WITH TIME ZONE '2020-08-03 17:40:02+00', 'Vos esquece a afeição tão doce nossa?
');
	VALUES (581, 657, TIMESTAMP WITH TIME ZONE '2020-08-04 00:45:31+00', 'Dos odres e Calipsos namoradas;
');
	VALUES (581, 657, TIMESTAMP WITH TIME ZONE '2020-08-04 07:49:19+00', '"Vê-lo cá, donde Sancho desbarata
');
	VALUES (581, 579, TIMESTAMP WITH TIME ZONE '2020-08-04 10:15:34+00', '"Vês corre a costa célebre Indiana
');

	VALUES (582, 605, TIMESTAMP WITH TIME ZONE '2020-08-12 02:19:20+00', 'E assim entravam ledos e guerreiros.
');
	VALUES (582, 579, TIMESTAMP WITH TIME ZONE '2020-08-12 03:14:47+00', 'Que da paternal coxa foi nascido,
');
	VALUES (582, 605, TIMESTAMP WITH TIME ZONE '2020-08-12 05:21:17+00', '"Posto que a rica Arábia e que os ferozes
');

	VALUES (583, 639, TIMESTAMP WITH TIME ZONE '2018-12-25 07:16:24+00', '"Viram gentes incógnitas e estranhas
');

	VALUES (584, 636, TIMESTAMP WITH TIME ZONE '2019-07-07 23:01:15+00', 'Das capelas de louro que me honrassem,
');
	VALUES (584, 580, TIMESTAMP WITH TIME ZONE '2019-07-08 02:49:27+00', 'Quando as fermosas Ninfas, cos amantes
');
	VALUES (584, 636, TIMESTAMP WITH TIME ZONE '2019-07-08 04:15:21+00', 'Não menos suas terras mal sustenta
');
	VALUES (584, 636, TIMESTAMP WITH TIME ZONE '2019-07-08 05:46:26+00', 'Descobridor das terras do Oriente.
');

	VALUES (585, 582, TIMESTAMP WITH TIME ZONE '2019-07-11 03:36:28+00', 'Forçado da fatal necessidade,
');
	VALUES (585, 638, TIMESTAMP WITH TIME ZONE '2019-07-11 10:40:56+00', '"Sublime Rei, a quem do Olimpo puro
');
	VALUES (585, 582, TIMESTAMP WITH TIME ZONE '2019-07-11 16:44:15+00', 'E do grão coração que lhe ficara.
');

	VALUES (586, 583, TIMESTAMP WITH TIME ZONE '2019-10-05 03:00:42+00', 'Saberá, se mais tempo ali o detinha.
');

	VALUES (587, 584, TIMESTAMP WITH TIME ZONE '2019-08-23 15:57:20+00', 'Dos filhos e das filhas que gerara;
');
	VALUES (587, 584, TIMESTAMP WITH TIME ZONE '2019-08-23 23:49:05+00', 'Para verem trabalhos excessivos.
');
	VALUES (587, 666, TIMESTAMP WITH TIME ZONE '2019-08-24 05:04:26+00', 'Fortuna o trouxe a tão loiro desterro.
');
	VALUES (587, 666, TIMESTAMP WITH TIME ZONE '2019-08-24 05:31:33+00', 'Não é o outro que fica tão manhoso;
');

	VALUES (588, 585, TIMESTAMP WITH TIME ZONE '2019-02-02 18:11:37+00', 'De Europa toda, o Reino Lusitano,
');

	VALUES (589, 627, TIMESTAMP WITH TIME ZONE '2018-09-12 08:43:33+00', 'Ela nos paços logra seus amores,
');

	VALUES (590, 632, TIMESTAMP WITH TIME ZONE '2019-09-27 06:08:34+00', 'E néctar sobre todos esparziu.
');
	VALUES (590, 632, TIMESTAMP WITH TIME ZONE '2019-09-27 08:44:37+00', 'Que nenhum torne à pátria só pretende
');
	VALUES (590, 632, TIMESTAMP WITH TIME ZONE '2019-09-27 10:40:07+00', 'Que Júpiter, Mercúrio, Febo e Marte,
');
	VALUES (590, 586, TIMESTAMP WITH TIME ZONE '2019-09-27 16:13:06+00', 'Com esta a forte Arronches sojugada
');

	VALUES (591, 663, TIMESTAMP WITH TIME ZONE '2020-03-26 00:47:31+00', 'Acude e corre, pai, que se não corres,
');

	VALUES (592, 587, TIMESTAMP WITH TIME ZONE '2019-08-17 04:46:55+00', 'E de metais ornados reluzentes,
');

	VALUES (593, 588, TIMESTAMP WITH TIME ZONE '2020-12-12 04:42:50+00', 'E tomada licença, enfim se parte:
');
	VALUES (593, 620, TIMESTAMP WITH TIME ZONE '2020-12-12 05:19:16+00', '"Sancho, forte mancebo, que ficara
');

	VALUES (594, 641, TIMESTAMP WITH TIME ZONE '2021-01-18 02:22:14+00', 'Mas sempre (o Céu querendo) fará menos.
');
	VALUES (594, 641, TIMESTAMP WITH TIME ZONE '2021-01-18 08:51:22+00', 'E Flora derramava o de Amalteia:
');
	VALUES (594, 641, TIMESTAMP WITH TIME ZONE '2021-01-18 11:01:37+00', '"O Rei de Badajoz era alto Mouro,
');
	VALUES (594, 641, TIMESTAMP WITH TIME ZONE '2021-01-18 15:57:55+00', 'Mas Nuno, que não quer por outras vias
');

	VALUES (595, 605, TIMESTAMP WITH TIME ZONE '2021-01-03 16:51:35+00', 'Contra os humanos fracos e atrevidos?
');
	VALUES (595, 589, TIMESTAMP WITH TIME ZONE '2021-01-03 18:28:57+00', 'É maior na prudência que nos anos,
');

	VALUES (596, 590, TIMESTAMP WITH TIME ZONE '2020-07-24 22:09:39+00', 'Das honras e dinheiro, que a ventura
');
	VALUES (596, 590, TIMESTAMP WITH TIME ZONE '2020-07-25 02:58:17+00', 'Nos soldados a tudo obedientes,
');
	VALUES (596, 661, TIMESTAMP WITH TIME ZONE '2020-07-25 10:04:09+00', '"Também movem da guerra as negras fúrias
');

	VALUES (597, 689, TIMESTAMP WITH TIME ZONE '2020-07-22 01:07:15+00', 'Em casos desta sorte duvidosos,
');

	VALUES (598, 686, TIMESTAMP WITH TIME ZONE '2019-12-13 23:51:45+00', 'Maçuá, com cisternas de água cheias
');
	VALUES (598, 591, TIMESTAMP WITH TIME ZONE '2019-12-14 03:15:51+00', '"Ajuda-o seu destino de maneira
');

	VALUES (599, 637, TIMESTAMP WITH TIME ZONE '2021-05-18 00:12:52+00', 'Que também nele tem curso ordenado
');
	VALUES (599, 594, TIMESTAMP WITH TIME ZONE '2021-05-18 00:56:10+00', 'A terra, usada aos casos de Mavorte,
');
	VALUES (599, 594, TIMESTAMP WITH TIME ZONE '2021-05-18 01:21:38+00', 'Tenho destes cristãos sanguinolentos,
