	VALUES (603, 679, TIMESTAMP WITH TIME ZONE '2020-12-25 10:32:59+00', '"Tu só, tu, puro Amor, com força crua,
');
	VALUES (603, 679, TIMESTAMP WITH TIME ZONE '2020-12-25 17:31:57+00', 'Mais estanças cantara esta Sirena
');

	VALUES (604, 598, TIMESTAMP WITH TIME ZONE '2019-11-28 02:48:35+00', 'O grã progenitor dos Reis primeiros.
');

	VALUES (605, 627, TIMESTAMP WITH TIME ZONE '2020-11-13 12:56:21+00', 'Em que estás e serás inda tornado,
');
	VALUES (605, 599, TIMESTAMP WITH TIME ZONE '2020-11-13 17:18:24+00', 'E tu me esperarás, se Amor te fere:
