	VALUES (608, 601, TIMESTAMP WITH TIME ZONE '2021-03-09 02:48:46+00', 'O nome do guerreiro Santiago,
');

	VALUES (609, 601, TIMESTAMP WITH TIME ZONE '2021-04-14 04:50:40+00', 'Por nós, da mesma já contada gente,
');
	VALUES (609, 666, TIMESTAMP WITH TIME ZONE '2021-04-14 12:04:28+00', 'Chamará o Samorim mais gente nova;
