	VALUES (609, 601, TIMESTAMP WITH TIME ZONE '2021-04-14 17:19:26+00', 'Tantas terras, por ver segredos delas,
');

	VALUES (610, 684, TIMESTAMP WITH TIME ZONE '2019-03-28 16:16:50+00', 'Porque, tanto que lasso se adormece,
');
	VALUES (610, 684, TIMESTAMP WITH TIME ZONE '2019-03-28 18:44:30+00', 'De quem Orfeu pariste, ó linda Dama,
');

	VALUES (611, 615, TIMESTAMP WITH TIME ZONE '2019-10-20 18:51:18+00', 'Torres altas se vêem no campo aberto
');
