	VALUES (615, 634, TIMESTAMP WITH TIME ZONE '2020-06-29 14:25:51+00', 'Se do grande valor da forte gente
');
	VALUES (615, 606, TIMESTAMP WITH TIME ZONE '2020-06-29 15:55:46+00', 'Tomou lugar, e nem por quente ou f rio,
');

