	VALUES (617, 646, TIMESTAMP WITH TIME ZONE '2020-08-29 00:39:17+00', 'Tais palavras do sábio peito abria:
');

	VALUES (618, 611, TIMESTAMP WITH TIME ZONE '2020-11-02 17:35:42+00', 'Quando um teu ramo, ó Gama, se exprimenta
');
	VALUES (618, 628, TIMESTAMP WITH TIME ZONE '2020-11-02 22:31:02+00', 'Sujeitos ao Império de Alemanha
');
	VALUES (618, 628, TIMESTAMP WITH TIME ZONE '2020-11-03 01:22:25+00', 'Em cujo senhorio o glória estranha
');
	VALUES (618, 628, TIMESTAMP WITH TIME ZONE '2020-11-03 05:24:33+00', 'Que fale mais, se ouvir-me o mais quiseres;
