	VALUES (622, 680, TIMESTAMP WITH TIME ZONE '2019-03-02 02:01:41+00', 'Cursos do sol quatorze vezes cento,
');
	VALUES (622, 614, TIMESTAMP WITH TIME ZONE '2019-03-02 07:23:30+00', 'Esperá-lo em cilada, oculto e quedo;
