');
	VALUES (623, 657, TIMESTAMP WITH TIME ZONE '2019-10-20 14:17:50+00', 'E na língua, na qual quando imagina,
');

	VALUES (624, 615, TIMESTAMP WITH TIME ZONE '2019-09-25 23:59:14+00', 'Vão-a buscar, e mandam adiante,
');
	VALUES (624, 639, TIMESTAMP WITH TIME ZONE '2019-09-26 05:54:05+00', 'O tempo, que para a partida o chama,
