');

	VALUES (628, 653, TIMESTAMP WITH TIME ZONE '2021-01-04 21:38:32+00', 'Não se aprende, Senhor, na fantasia,
');
	VALUES (628, 653, TIMESTAMP WITH TIME ZONE '2021-01-04 23:42:08+00', 'Por este mar a gente Lusitana,
');
	VALUES (628, 618, TIMESTAMP WITH TIME ZONE '2021-01-05 05:51:18+00', '"Se os antigos delitos, que a malícia
');

	VALUES (629, 620, TIMESTAMP WITH TIME ZONE '2020-12-12 14:23:21+00', 'As gentes Lusitanas, que esperassem;
