	VALUES (669, 689, TIMESTAMP WITH TIME ZONE '2019-10-02 11:34:32+00', 'Aceso de ira, o Cão, não vendo lassos
');

	VALUES (670, 660, TIMESTAMP WITH TIME ZONE '2019-12-11 17:25:21+00', 'Alevantando o rosto, assim dizia:
');
	VALUES (670, 659, TIMESTAMP WITH TIME ZONE '2019-12-12 00:12:35+00', 'Da quieta e da simples inocência,
');
	VALUES (670, 659, TIMESTAMP WITH TIME ZONE '2019-12-12 03:24:30+00', 'Mas conquistando as ondas do Oceano,
');

	VALUES (671, 659, TIMESTAMP WITH TIME ZONE '2019-08-14 09:39:58+00', 'Que da famosa Meca as naus chegassem.
');
	VALUES (671, 659, TIMESTAMP WITH TIME ZONE '2019-08-14 14:25:27+00', 'Não vimos mais enfim que mar e céu.
');

	VALUES (672, 660, TIMESTAMP WITH TIME ZONE '2019-12-16 21:59:52+00', 'Varias províncias tem de várias gentes,
');
	VALUES (672, 660, TIMESTAMP WITH TIME ZONE '2019-12-17 05:50:59+00', 'Vilas, castelos toma à escala vista.
');
	VALUES (672, 660, TIMESTAMP WITH TIME ZONE '2019-12-17 07:46:35+00', '"Olha cá dois infantes, Pedro e Henrique,
');
	VALUES (672, 665, TIMESTAMP WITH TIME ZONE '2019-12-17 13:44:51+00', 'De Arábia e Pérsias terras abundantes.
');

	VALUES (673, 660, TIMESTAMP WITH TIME ZONE '2019-12-07 23:36:51+00', 'Os ossos para sempre sepultaram.
');

	VALUES (674, 661, TIMESTAMP WITH TIME ZONE '2019-02-15 02:12:53+00', 'Noutra parte esculpida estava a guerra,
');
	VALUES (674, 666, TIMESTAMP WITH TIME ZONE '2019-02-15 03:37:38+00', 'Ajuntarem o exército inquieto
');

	VALUES (675, 661, TIMESTAMP WITH TIME ZONE '2020-06-20 03:38:44+00', 'Mas cüa escrava vil, lasciva e escura.
');

	VALUES (676, 662, TIMESTAMP WITH TIME ZONE '2021-02-19 06:02:43+00', 'Do Gangético mar ao Gaditano,
');

	VALUES (677, 663, TIMESTAMP WITH TIME ZONE '2020-03-14 12:13:52+00', 'Tal o formoso esmalte se notava
');

	VALUES (678, 675, TIMESTAMP WITH TIME ZONE '2021-01-09 09:22:02+00', 'Que não o empregue em quem o não mereça,
');
	VALUES (678, 664, TIMESTAMP WITH TIME ZONE '2021-01-09 11:05:23+00', 'Fiado na promessa e consciência
');

	VALUES (679, 668, TIMESTAMP WITH TIME ZONE '2021-02-20 17:22:37+00', 'Em muitos dos exemplos que apresenta);
');
	VALUES (679, 694, TIMESTAMP WITH TIME ZONE '2021-02-20 19:32:46+00', 'Cidade Meca, que se engrandeceu
');

	VALUES (680, 668, TIMESTAMP WITH TIME ZONE '2021-01-11 18:25:43+00', 'Que sejam, determino, agasalhados
');
	VALUES (680, 668, TIMESTAMP WITH TIME ZONE '2021-01-11 22:55:20+00', 'No campo e na cidade juntamente.
');

	VALUES (681, 681, TIMESTAMP WITH TIME ZONE '2019-08-12 00:28:36+00', 'Aquela alta e divina Eternidade,
');
	VALUES (681, 670, TIMESTAMP WITH TIME ZONE '2019-08-12 02:47:40+00', 'E grande esforço faz inveja à gente.
');
	VALUES (681, 670, TIMESTAMP WITH TIME ZONE '2019-08-12 06:59:06+00', 'Mas um tiro, que com zunido voa,
');
	VALUES (681, 670, TIMESTAMP WITH TIME ZONE '2019-08-12 11:45:23+00', 'Entre os Deuses, no Olimpo consagrado.
');

	VALUES (682, 687, TIMESTAMP WITH TIME ZONE '2021-03-10 16:24:18+00', 'Do primeiro que guerra fez no mundo;
');
	VALUES (682, 687, TIMESTAMP WITH TIME ZONE '2021-03-10 20:59:07+00', 'Seu tão célebre nome em negro vaso
');
	VALUES (682, 687, TIMESTAMP WITH TIME ZONE '2021-03-11 01:45:25+00', 'Não menos é trabalho, que grande erro,
');
	VALUES (682, 687, TIMESTAMP WITH TIME ZONE '2021-03-11 04:39:40+00', 'Se ainda dura o Gentio antigo rito,
');

	VALUES (683, 671, TIMESTAMP WITH TIME ZONE '2019-08-01 15:55:22+00', 'Mas, já chegado aos fins Orientais
');
	VALUES (683, 685, TIMESTAMP WITH TIME ZONE '2019-08-01 17:10:28+00', 'Sobre as flores da terra em frio orvalho,
');
	VALUES (683, 685, TIMESTAMP WITH TIME ZONE '2019-08-01 17:40:17+00', 'Uma gente fortíssima de Espanha
');
	VALUES (683, 671, TIMESTAMP WITH TIME ZONE '2019-08-01 20:03:07+00', 'Onde a mãe, que tão pouco o parecia,
');

	VALUES (684, 674, TIMESTAMP WITH TIME ZONE '2021-05-12 12:27:01+00', 'Canela, cravo, ardente especiaria,
');
	VALUES (684, 674, TIMESTAMP WITH TIME ZONE '2021-05-12 14:47:41+00', 'E do Giruna frio e Reno fundo.
');
	VALUES (684, 673, TIMESTAMP WITH TIME ZONE '2021-05-12 18:29:00+00', 'Para ele os largos passos inclinando,
');

	VALUES (685, 673, TIMESTAMP WITH TIME ZONE '2021-04-06 02:30:15+00', 'Carlos, pai dela, posto em causas grandes,
');
	VALUES (685, 693, TIMESTAMP WITH TIME ZONE '2021-04-06 09:01:21+00', 'Carmesi, cor que a gente tanto preza:
');
	VALUES (685, 673, TIMESTAMP WITH TIME ZONE '2021-04-06 11:51:25+00', 'Que bem vê que grandíssimo proveito
');

	VALUES (686, 691, TIMESTAMP WITH TIME ZONE '2020-05-11 07:07:58+00', 'Ameaçando a terra, o mar e o mundo:
');
	VALUES (686, 691, TIMESTAMP WITH TIME ZONE '2020-05-11 10:32:02+00', 'Não cabe o altivo peito, tão pequeno.
');

	VALUES (687, 676, TIMESTAMP WITH TIME ZONE '2021-01-20 14:17:35+00', 'Mas alembrou-lhe üa ira que o condena,
