	VALUES (687, 677, TIMESTAMP WITH TIME ZONE '2021-01-20 16:19:34+00', 'Que está com luz tão clara radiando
');
	VALUES (687, 676, TIMESTAMP WITH TIME ZONE '2021-01-20 20:42:58+00', 'Dos anjos, que tão longe nos guiou,
');

	VALUES (688, 676, TIMESTAMP WITH TIME ZONE '2018-11-20 22:39:19+00', 'Depois que a branda Vénus enfraquece
');
	VALUES (688, 683, TIMESTAMP WITH TIME ZONE '2018-11-21 00:50:35+00', 'Da mágoa, da desonra, e triste nojo
');

	VALUES (689, 680, TIMESTAMP WITH TIME ZONE '2018-09-15 14:43:55+00', 'Do mundo onde morais distintamente;
');
	VALUES (689, 680, TIMESTAMP WITH TIME ZONE '2018-09-15 16:06:12+00', 'Memoráveis, de herança nos deixaram
');

	VALUES (690, 688, TIMESTAMP WITH TIME ZONE '2019-12-21 12:53:35+00', 'A divisa, que tem na mão tomada?"
');
	VALUES (690, 688, TIMESTAMP WITH TIME ZONE '2019-12-21 15:22:47+00', 'Uma noite de Dóris prometida,
');

	VALUES (691, 679, TIMESTAMP WITH TIME ZONE '2020-12-23 13:16:10+00', 'Põe na fama alva noda negra e feia.
');

	VALUES (692, 679, TIMESTAMP WITH TIME ZONE '2021-01-03 00:14:10+00', 'Que lhe não tire o esforço e ousadia
');

	VALUES (693, 686, TIMESTAMP WITH TIME ZONE '2020-02-08 21:23:01+00', '"Eu sou bem informado que a embaixada
');
	VALUES (693, 682, TIMESTAMP WITH TIME ZONE '2020-02-09 00:02:04+00', '"Tempo cedo virá que outras vitórias
');

	VALUES (694, 688, TIMESTAMP WITH TIME ZONE '2020-01-03 18:00:09+00', 'Tão querido de todos, e benquisto,
');
	VALUES (694, 688, TIMESTAMP WITH TIME ZONE '2020-01-03 20:00:35+00', 'Que sete ilustres Condes lhe trouxeram
');
	VALUES (694, 688, TIMESTAMP WITH TIME ZONE '2020-01-04 00:20:10+00', 'Das vidas de seus filhos, quer que fiquem
');
	VALUES (694, 688, TIMESTAMP WITH TIME ZONE '2020-01-04 08:18:26+00', 'Da parte Oriental para Lisboa,
');

	VALUES (695, 686, TIMESTAMP WITH TIME ZONE '2019-12-01 23:01:49+00', 'A Lápia fria, a inculta Noruega,
