	VALUES (696, 685, TIMESTAMP WITH TIME ZONE '2020-03-12 18:55:36+00', 'Cortam do mar do Norte as ondas frias.
');
	VALUES (696, 696, TIMESTAMP WITH TIME ZONE '2020-03-12 22:07:04+00', 'E, sendo da ociosa mão movido
');

	VALUES (697, 685, TIMESTAMP WITH TIME ZONE '2021-03-29 06:19:18+00', 'Vão outros dar à bomba, não cessando;
');
	VALUES (697, 687, TIMESTAMP WITH TIME ZONE '2021-03-29 07:53:53+00', '--"A que novos desastres determinas
');
	VALUES (697, 685, TIMESTAMP WITH TIME ZONE '2021-03-29 13:52:05+00', 'Olha como, em tão justa e santa guerra,
');

	VALUES (698, 686, TIMESTAMP WITH TIME ZONE '2019-11-03 04:11:26+00', 'Levava aos Antípodas o dia,
');

	VALUES (699, 696, TIMESTAMP WITH TIME ZONE '2020-03-25 15:41:30+00', 'Do belo corpo estavam confiadas,
');

	VALUES (700, 687, TIMESTAMP WITH TIME ZONE '2021-03-19 13:44:33+00', 'Que antes querem ao mar aventurar-se
');

	VALUES (701, 696, TIMESTAMP WITH TIME ZONE '2020-02-26 01:29:07+00', 'Do cheiroso licor que o tronco chora,
